ME","statefulName":"n/AtRisk.TSEGNAME","vintage":null,"type":"esriFieldTypeString"},"CUSTOMB9F38C8DECFE4971AD1C80D258FD9273":{"hasVariable":true,"name":"CUSTOMB9F38C8DECFE4971AD1C80D258FD9273","templateName":"dataCollectionsCalculator.CUSTOMB9F38C8DECFE4971AD1C80D258FD9273","alias":"TOP1_Defintion7","variableID":"CUSTOMB9F38C8DECFE4971AD1C80D258FD9273","fullName":"dataCollectionsCalculator.CUSTOMB9F38C8DECFE4971AD1C80D258FD9273","statefulName":"n/dataCollectionsCalculator.CUSTOMB9F38C8DECFE4971AD1C80D258FD9273","type":"esriFieldTypeString","usedFields":["TAPESTRYNEWTOP1NUM"],"expressionText":"segDef = [\"Affluent Estates\",\"Affluent Estates\",\"Affluent Estates\",\"Affluent Estates\",\"Affluent Estates\",\"Upscale Avenues \",\"Upscale Avenues \",\"Upscale Avenues \",\"Upscale Avenues \",\"Uptown Individuals\",\"Uptown Individuals\",\"Uptown Individuals\",\"Family Landscapes\",\"Family Landscapes\",\"Family Landscapes\",\"GenXurban\",\"GenXurban\",\"GenXurban\",\"GenXurban\",\"GenXurban\",\"Cozy Country Living\",\"Cozy Country Living\",\"Cozy Country Living\",\"Cozy Country Living\",\"Cozy Country Living\",\"Cozy Country Living\",\"Sprouting Explorers\",\"Sprouting Explorers\",\"Sprouting Explorers\",\"Sprouting Explorers\",\"Sprouting Explorers\",\"Sprouting Explorers\",\"Middle Ground\",\"Middle Ground\",\"Middle Ground\",\"Middle Ground\",\"Middle Ground\",\"Middle Ground\",\"Middle Ground\",\"Senior Styles\",\"Senior Styles\",\"Senior Styles\",\"Senior Styles\",\"Senior Styles\",\"Senior Styles\",\"Rustic Outposts\",\"Rustic Outposts\",\"Rustic Outposts\",\"Rustic Outposts\",\"Rustic Outposts\",\"Midtown Singles\",\"Midtown Singles\",\"Midtown Singles\",\"Midtown Singles\",\"Midtown Singles\",\"Hometown\",\"Hometown\",\"Hometown\",\"Hometown\",\"Next Wave\",\"Next Wave\",\"Next Wave\",\"Next Wave\",\"Next Wave\",\"Scholars and Patriots\",\"Scholars and Patriots\",\"Scholars and Patriots\",\"Unclassified\"]%nl%returnValue(segDef[int(!TAPESTRYNEWTOP1NUM!)-1])"}},"xmlString":"<b style=\"\"><span style=\"color: rgb(58, 194, 239);\"><span style=\"font-size:14px;\">[ATRISKTSEGNAME_T]</span></span></b><span style=\"font-size:13px;font-family:Avenir Next;\"><b>: </b><i>[CUSTOMB9F38C8DECFE4971AD1C80D258FD9273]</i></span> LifeMode"}}}}],"style":{"width":350,"left":9,"top":326,"spaceAfter":0,"autoSizeRows":false},"attributes":{"noSorting":false,"noChartView":false}},{"id":"table","customName":"Seg definition","columns":[{"field":"field0","style":{"width":330}}],"rows":[{"style":{"fields":{"field0":{"horizontalAlign":"left","verticalAlign":"top","backgroundColor":"rgba(0, 0, 0, 0)","fontWeight":"normal","fontStyle":"normal","textDecoration":"none"}},"height":200},"fieldInfos":{"field0":{"isRichText":true,"richTextJson":{"fieldInfos":{"CUSTOMBB9282F058774071BA41A3E4313BFB32":{"hasVariable":true,"name":"CUSTOMBB9282F058774071BA41A3E4313BFB32","templateName":"dataCollectionsCalculator.CUSTOMBB9282F058774071BA41A3E4313BFB32","alias":"TOP1_Defintion6","variableID":"CUSTOMBB9282F058774071BA41A3E4313BFB32","fullName":"dataCollectionsCalculator.CUSTOMBB9282F058774071BA41A3E4313BFB32","statefulName":"n/dataCollectionsCalculator.CUSTOMBB9282F058774071BA41A3E4313BFB32","type":"esriFieldTypeString","usedFields":["TAPESTRYNEWTOP1NUM"],"expressionText":"segDef = [\"The residents of the wealthiest Tapestry market, Top Tier, earn more than three times the US household income. They have the purchasing power to indulge any choice, but what do their hearts desire? Aside from the obvious expense for the upkeep for upkeep of their lavish homes, consumers select upscale salons, spas, and fitness centers for their personal well-being and shop at high-end retailers for their personal effects...\",\"Professional Pride consumers are well-educated career professionals that have prospered through the Great Recession. To maintain their upscale suburban lifestyles, these goal oriented couples work, often commuting far and working long hours. However, their schedules are fine-tuned to meet the needs of their school age children...\",\"This is the new growth market, with a profile similar to the original young professionals with families that have opted to trade up to the newest housing in the suburbs. The original Boomburbs neighborhoods began growing in the 1990s and continued through the peak of the housing boom... \",\"Savvy Suburbanites residents are well educated, well read, and well capitalized. Families include empty nesters and empty nester wannabes, who still have adult children at home. Located in older neighborhoods outside the urban core, their suburban lifestyle includes home remodeling and gardening plus the active pursuit of sports and exercise... \",\"Exurbanites residents are now approaching retirement but showing few signs of slowing down. They are active in their communities, generous in their donations, and seasoned travelers. They take advantage of their proximity to large metropolitan centers to support the arts but prefer a more expansive home style in less crowded neighborhoods... \",\"Urban Chic residents are professionals that live a sophisticated, exclusive lifestyle. Half of all households are occupied by married-couple families and about 30 percent are singles. These are busy, well-connected, and well-educated consumers-avid readers and movie goers, environmentally active, and financially stable... \",\"Prosperous domesticity best describes the settled denizens of Pleasantville. Situated principally in older housing in suburban areas in the Northeast (especially in New York and New Jersey) and secondarily in the West (especially in California), these slightly older couples move less than any other market. Many couples have already transitioned to empty nesters. Many are still home to adult children... \",\"Pacific Heights is one of the smaller markets (with less than 1 percent of households), composed of upscale neighborhoods in the urban periphery of metropolitan areas, along the Pacific Coast in California, in Hawaii, and in the Northeast. This market includes the highest percentage of multiracial populations. This is a family market, distinguished by married-couple families, with and without children, some in multigenerational households... \",\"Enterprising Professionals residents are well educated and climbing the ladder in STEM (science, technology, engineering, and mathematics) occupations. They change jobs often and therefore choose to live in condos, town homes, or apartments - many still rent their homes... \",\"Laptops and Lattes residents are predominantly single, well-educated professionals in business, finance, legal, computer, and entertainment occupations. They are affluent and partial to city living-and its amenities. Neighborhoods are densely populated, primarily located in the cities of large metropolitan areas. Many residents walk, bike, or use public transportation to get to work... \",\"Residents in this highly mobile and educated market live alone or with a roommate in older apartment buildings and condos located in the urban core of the city. Metro Renters is one of the fastest growing segments. The popularity of urban life continues to increase for consumers in their late twenties and thirties...\",\"Armed with the motto -you are only young once-, Trendsetters residents live life to its full potential. These educated young singles are not ready to settle down. They do not own homes or vehicles and choose to spend their disposable income on upscale city living and entertainment... \",\"Workday Drive is an affluent, family-oriented market with a country flavor. Residents are partial to new housing away from the bustle of the city but close enough to commute to professional job centers. Life in this suburban wilderness offsets the hectic pace of two working parents with growing children... \",\"Married-couple families occupy well over half of these suburban households. Most Home Improvement residences are single-family homes that are owner occupied, with only one-fifth of the households occupied by renters. Education and diversity levels are similar to the US as a whole... \",\"Middleburg neighborhoods transformed from the easy pace of country living to semirural subdivisions in the last decade, when the housing boom reached out. Residents are traditional, family-oriented consumers. Still more country than rock and roll they are thrifty but willing to carry some debt and are already investing in their futures... \",\"Residents in this large, growing segment are older, with more than half of all householders aged 55 or older. Many still live in the suburbs where they grew up. Comfortable Empty Nesters are mostly professionals working in government, health care, or manufacturing. These Baby Boomers are earning a comfortable living and benefitting from years of prudent investing and saving... \",\"In Style denizens embrace an urbane lifestyle that includes support of the arts, travel, and extensive reading. They are connected and make full use of the advantages of mobile devices. Professional couples or single households without children, they have the time to focus on their homes and their interests. The population is slightly older and already planning for their retirement. \",\"These suburbanites have achieved the dream of home ownership. Parks and Rec residents have purchased homes that are within their means. Their homes are older, and town homes and duplexes are not uncommon. Many of these families are two-income married ccouples approaching retirement age... \",\"The backbone of older industrial cities in states surrounding the Great Lakes, Rustbelt Traditions residents are a mix of married-couple families and singles living in older developments of single-family homes. While varied, the work force is primarily white collar, with a higher concentration of skilled workers in manufacturing, retail trade, and health care... \",\"Midlife Constants residents are seniors, at or approaching retirement, with below average labor force participation and above average net worth. Although located in predominantly metropolitan areas, they live outside the central cities, in smaller communities. Their lifestyle is more country than urban. They are generous, but not spendthrifts. \",\"The Green Acres lifestyle features country living and self-reliance. Avid do-it-yourselfers, they maintain and remodel their homes with all the necessary power tools to accomplish the jobs. Gardening, especially growing vegetables, is a priority, with the right tools, tillers, tractors, and riding mowers... \",\"Salt of the Earth residents are entrenched in their traditional, rural lifestyles. Citizens here are older, and many have grown children that have moved away. They still cherish family time and also tending to their vegetable gardens and preparing homemade meals... \",\"The Great Outdoors neighborhoods are found in pastoral settings throughout the United States. Consumers are educated empty nesters living an active but modest lifestyle. Their focus is land. They are more likely to invest in real estate or a vacation home than stocks... \",\"Prairie Living is the most rural market, comprising about 1 percent of households, located mainly in the Midwest, with a predominance of self-employed farmers. These agricultural communities are dominated by married-couple families that own single-family dwellings and many vehicles... \",\"Although the Great Recession forced many owners of second homes to sell, Rural Resort Dwellers residents remain an active market, just a bit smaller. These communities are centered in resort areas, many in the Midwest, where the change in seasons supports a variety of outdoor activities... \",\"Well settled and close-knit, Heartland Communities are semirural and semiretired. These older householders are primarily homeowners, and many have paid off their mortgages. Their children have moved away, but they have no plans to leave their homes. Their hearts are with the country and they embrace the slower pace of life, but actively participate in outdoor activities and community events... \",\"Up and Coming Families is a market in transition-residents are younger and more mobile than the previous generation. They are ambitious, working hard to get ahead, and willing to take some risks to achieve their goals. Their homes are new and their families are young... \",\"Urban Villages residents multigenerational and multilingual. Trendy and fashion conscious, they are risk takers. However, these consumers focus on their children and maintain gardens. They are well connected with their smartphones but more likely to shop in person... \",\"Located throughout the South and West, most Urban Edge families own their own homes, primarily single-family housing-out of the city, where housing is more affordable. Median household income is slightly below average (Index 91). The majority of households include younger married-couple families with children and, frequently, grandparents... \",\"Family is central within the Forging Opportunity communities bringing rich traditions to these neighborhoods in the urban outskirts. Dominating this market are younger families with children or single-parent households with multiple generations living under the same roof. These households balance their budgets carefully but also indulge in the latest trends and purchase with an eye to brands... \",\"Farm to Table is a small, but distinctive market, located almost entirely in the West (primarily in California and Washington). These neighborhoods are home to young families with children and, frequently, multiple generations living in single-family homes. A third of these residents are foreign born... \",\"Residents in these neighborhoods are young families primarily located in the Southwest. Children are the center of households that are composed mainly of married couples with children and single-parent families. Grandparents are caregivers in some of these households... \",\"City Lights is a densely populated urban market. The wide-ranging demographic characteristics of residents mirror their passion for social welfare and equal opportunity. Household types range from single person to married-couple families, with and without children... \",\"Emerald City denizens live in lower-density neighborhoods of urban areas throughout the country. Young and mobile, they are more likely to rent. Half have a college degree and a professional occupation. Incomes close to the US median come primarily from wages, investments, and self-employment.... \",\"Bright Young Professionals is a large market, primarily located in urban outskirts of large metropolitan areas. These communities are home to young, educated, working professionals. One out of three householders is under the age of 35. Slightly more diverse couples dominate this market, with more renters than homeowners... \",\"Downtown Melting Pot is a smaller, settled market, composed of much older neighborhoods located in cities in the Middle Atlantic division (mainly New York) or on the Pacific Coast. A mix of races and ethnicities reside here with close to half of the residents foreign born, nearly a third who do not speak English... \",\"Front Porches are a blend of household types, with more young families with children and more single households than average. Half of householders are renters, and many of the homes are older town homes or duplexes... \",\"This market features singles on a budget. The focus is more on convenience than consumerism, economy over acquisition. Old and Newcomers is composed of neighborhoods in transition, populated by renters who are just beginning their careers or retiring... \",\"Hometown Heritage neighborhoods are in urbanized areas within central cities, with older housing, located mainly in the Midwest and South. This slightly smaller market is primarily a family market, married couples (with and without children) and single parents... \",\"Almost the oldest senior market, Silver and Gold is the most affluent senior market. The affluence of Silver and Gold has afforded the opportunity to retire to sunnier climates that feature exclusive communities and vacation homes... \",\"Independent, active seniors nearing the end of their careers or already in retirement best describes Golden Years residents. This market is primarily singles living alone or empty nesters. Those still active in the labor force are employed in professional occupations... \",\"With a median age of 71.8 years, this is oldest Tapestry market. The Elders residents favor communities designed for senior or assisted living, primarily in warmer climates with seasonal populations. Most of these householders are homeowners, although their housing varies from mobile homes to single-family residences to high-rise apartments... \",\"Senior Escapes neighborhoods are heavily concentrated in the warmer states of Florida, California, and Arizona. These areas are highly seasonal, yet owner occupied. Many homes began as seasonal getaways and now serve as primary residences... \",\"Retirement Communities neighborhoods are evenly distributed across the country. They combine single-family homes and independent living with apartments, assisted living, and continuous care nursing facilities. Over half of the housing units are in multiunit structures, and the majority of residents have a lease... \",\"Social Security Set is an older market located in metropolitan cities across the country. Over one-third of householders here are aged 65 or older and dependent on low, fixed incomes, primarily Social Security. In the aftermath of the Great Recession retirement is now a dream for many approaching the retirement age... \",\"Southern Satellites is the second largest market found in rural settlements but within metropolitan areas located primarily in the South. This market is typically slightly older, settled married-couple families, who own their homes. Almost two-thirds of the homes are single-family structures and almost a third are mobile homes... \",\"Rooted Rural is heavily concentrated in the Appalachian mountain range as well as in Texas and Arkansas. Employment in the forestry industry is common, and Rooted Rural residents live in many of the heavily forested regions of the country. This group enjoys time spent outdoors... \",\"Close to one in five employed residents work in mining, oil and gas extraction, or quarrying industries. Economic BedRock is a very rural, primarily Southern market. Married-couple families reside in over half of the households, with a quarter of householders that live in... \",\"Down the Road is a mix of low-density, semirural neighborhoods in large metropolitan areas. Half are located in the South, with the rest primarily in the West and Midwest. Almost half of householders live in mobile homes... \",\"Open space, undeveloped land, and farmland characterize Rural Bypasses. These families live within small towns along country back roads and enjoy the open air in these sparsely populated neighborhoods. Their country lifestyle focuses on the outdoors, gardening, hunting, and fishing.... \",\"These high-density city neighborhoods are characterized by a relatively young foreign-born population who have embraced the American lifestyle yet retained their cultural integrity. To support their lifestyle, City Strivers residents commute long distances to find work in the service, healthcare, or retail industry... \",\"Gen Y comes of age. Well-educated young workers, some of whom are still completing their education, are employed in professional-technical occupations, as well as sales and office-administrative support roles. These Young and Restless residents are not established yet but striving to get ahead and improve themselves... \",\"Metro Fusion is a young market. Many residents do not speak English fluently and have moved into their homes recently. They are highly mobile and over three quarters of households are occupied by renters. Many households have young children... \",\"Set to Impress is depicted by medium to large multiunit apartments with lower than average rents. These apartments are often nestled into neighborhoods with other businesses or single-family housing. Nearly one in three residents is 20 to 34 years old, and a large portion are single person nonfamily households... \",\"City Commons is one of the youngest and largest markets. It is primarily comprised of single-parent and single-person households living within large, metro cities located primarily in the eastern half of the US. While more than a third have a college degree or spent some time in college, nearly a quarter have not finished high school... \",\"Family and faith are the cornerstones of life in the Family Foundations communities. Older children, still living at home, working toward financial independence, are common within these households. Neighborhoods are stable - little household growth has occurred for more than a decade. Many residents work in the health care industry or public administration across all levels of government... \",\"Traditional Living residents in this segment live primarily in low-density, settled neighborhoods in the Midwest. The households are a mix of married-couple families and singles. Many families encompass two generations who have lived and worked in the community. Their children are likely to follow suit. The manufacturing, retail trade, and health care sectors are the primary sources of employment for these residents... \",\"Small Town Simplicity includes young families and senior householders that are bound by community ties. The lifestyle is down-to-earth and semirural, with television for entertainment and news, and emphasis on convenience for both young parents and senior citizens... \",\"Families in this urban segment may be nontraditional. Their religious faith and family values guide their modest lifestyles. Many Modest Income Home residents are primary caregivers to their elderly family members. Jobs are not always easy to come by, but wages and salary income are the main sources of income for most households... \",\"Diverse Convergence neighborhoods are a rich blend of cultures, found in densely populated urban and suburban areas, almost entirely in the Middle Atlantic (especially in New York and New Jersey) or in California. Almost 40 percent of residents are foreign-born... \",\"Family Extensions is a family-oriented market distinguished by multigenerational households. Their spending reflects their children-baby food and furniture or apparel for children and fast-food and family restaurants... \",\"NeWest Residents are new to America and their careers, often with new, young families. Many are new to the English language. Nearly one-third of households are linguistically isolated. As residents adopt the American way of life, many pursue employment opportunities for the benefit of their extended families... \",\"These young families, many of whom are recent immigrants, focus their life and work around their children. Fresh Ambitions have overcome the language barrier and earned a high school diploma. They work overtime in service, in skilled and unskilled occupations, and spend what they have on their children... \",\"High Rise Renters are located predominantly in the Northeast, especially in New York City. This market tops the chart for density, diversity, presence of adult children, linguistic isolation, and foreign-born population. They travel far for employment, usually in service jobs, and depend on public transportation... \",\"One of the youngest markets, residents of Military Proximity are married-couple families just beginning parenthood, with an average household size of 3.38. The Armed Forces is the common bond for these consumers. Most of the labor force are on active duty or have civilian jobs on military bases... \",\"About half the residents of College Towns are enrolled in college, while the rest work for a college or the services that support it. Students have busy schedules but make time between studying and part-time jobs for socializing and sports. Students that are new to managing their own finances tend to make impulse buys and splurge on the latest fashions... \",\"On their own for the first time, Dorms to Diplomas residents are just learning about finance and cooking. Frozen dinners and fast food are common options. Shopping trips are sporadic, and preferences for products are still being established. Many carry a balance on their credit card so they can buy what they want now... \",\"Tapestry Unclassified neighborhoods include unpopulated areas such as parks, golf courses, open space, or other types of undeveloped land. Institutional group quarters, such as prisons, juvenile detentions homes, and mental hospitals, or any area with insufficient data for classification also fall into this category... \"]%nl%returnValue(segDef[int(!TAPESTRYNEWTOP1NUM!)-1])"}},"linkFieldInfos":{"CUSTOM706F3C93E42645BC9B9577A0BE99616A":{"hasVariable":true,"name":"CUSTOM706F3C93E42645BC9B9577A0BE99616A","templateName":"dataCollectionsCalculator.CUSTOM706F3C93E42645BC9B9577A0BE99616A","alias":"TOP1_SEG_LINK","variableID":"CUSTOM706F3C93E42645BC9B9577A0BE99616A","fullName":"dataCollectionsCalculator.CUSTOM706F3C93E42645BC9B9577A0BE99616A","statefulName":"n/dataCollectionsCalculator.CUSTOM706F3C93E42645BC9B9577A0BE99616A","type":"esriFieldTypeString","usedFields":["TAPESTRYNEWTOP1NUM"],"expressionText":"returnValue(\"https://links.esri.com/tapestry/segment\" + str(!TAPESTRYNEWTOP1NUM!))"}},"xmlString":"<span style=\"font-size:13px;font-family:Avenir Next;\">[CUSTOMBB9282F058774071BA41A3E4313BFB32]<br/></span><span style=\"font-family:Avenir Next;\"><br/><br/><a hreff=\"CUSTOM706F3C93E42645BC9B9577A0BE99616A\" style=\"text-decoration: none;\" target=\"_blank\">Learn more...</a></span><span style=\"font-size:13px;font-family:Avenir Next;\"><br/></span>"}}}}] 47915A27094B49B509","type":"esriFieldTypeString","usedFields":["TAPESTRYNEWTOP1NUM"],"expressionText":"segDef = [\"These are the wealthiest consumers. They hire financial advisers to manage their diverse investment portfolios.\",\"Most have a preferred financial institution, regularly read financial news, and use the Internet for banking transactions.\",\"Financial planning is well under way for these professionals.\",\"Financially active, using a number of resources for informed investing. Many carry second mortgages and home equity credit lines.\",\"With wide-ranging investments, these investors rely on financial planners, extensive reading, and the Internet to handle their money.\",\"Financially shrewd residents that maintain a healthy portfolio of stocks, bonds, and real estate.\",\"Invest in conservative securities and contribute to charities.\",\"Financially conservative, these consumers tend to opt for low-risk investments.\",\"Have health insurance and a 401(k) through work.\",\"Invest in mutual funds (bonds) and maintain retirement savings plans.\",\"Willing to take risks and work long hours to get to the top of their profession.\",\"These consumers are spenders rather than savers. They seek financial advice and are already building their stock portfolios.\",\"Well insured and invested in a range of funds, from savings accounts or bonds to stocks.\",\"Cautious consumers that do their research before buying, they protect their investments. They are paying off student loans and home mortgages.\",\"Spending priorities also focus on family (toys and apparel for children) or home DIY projects. Residents are partial to domestic vehicles.\",\"Financial portfolio includes stocks, certificates of deposit, mutual funds, and real estate.\",\"Affluent market with income supplemented by investments and a substantial net worth. Actively support the arts, theater, and museums.\",\"This is a financially shrewd market. Consumers are careful to research their big-ticket purchases.\",\"Watching television is a common pastime.  Many households have more than four TVs - watch ABC Family Channel and TNT.\",\"Sociable, church-going residents belonging to veterans clubs and charitable organizations and do volunteer work and fund-raising.\",\"Income is derived not only from wages and salaries but also from self-employment, investments , and increasingly, from retirement.\",\"Outdoor activities, such as fishing, boating, hunting, and  camping  are popular. To support their pastimes, truck ownership is high.\",\"Many service their own autos, work on home improvement and remodeling projects, and maintain their own yards.\",\"Many own a truck, riding lawn mower, and ATV. They favor banking in person, have noninterest checking accounts, and invest in CDs.\",\"Drive older domestic vehicles and prefer to spend their disposable income on gear to support their hobbies, which include  fishing and hunting.\",\"Skeptical about their financial future, they stick to community banks and low-risk investments.\",\"Carry debt from credit card balances to student loans and mortgages, but also maintain retirement plans and make charitable contributions.\",\"Saving is more limited than spending in this young market. They carry credit cards, but banking is basic.\",\"Cell phones are preferred over landlines. During the summer, family outings to theme parks are especially popular.\",\"Many have no financial investments or retirement savings, but they have their homes.\",\"Many pay bills in person and prepare their own taxes. Work on home improvement projects, such as painting the house.\",\"Residents prefer to pay bills in person, but paying using their mobile devices is growing.\",\"Save for the future, often to achieve their dream of home ownership. They often engage in discussion about financial services with their peers.\",\"Liberal segment that contributes to NPR and PBS. Read magazines and books on a tablet, sometimes while exercising at home.\",\"Own retirement savings and student loans.\",\"Carry debt from credit card balances rather than loans or mortgages. Lack of investments in stocks and retirement plans.\",\"They seek adventure and strive to have fun. Participate in leisure activities including sports, playing board games and video games.\",\"Vehicles are just a means of transportation. Entertainment features include watching movies and listening to country music.\",\"They tend to save money for a specific purpose.\",\"Pursue the luxuries that well-funded retirement affords. Enjoy an active social life - travel, hobbies, and sports (especially golf).\",\"Residents maintain actively managed financial portfolios that include a range of instruments such as IRAs and common stocks,.\",\"Residents are sociable seniors, partial to a variety of clubs and organizations and generous with their time and support.\",\"They only spend within their means, do their banking in person, and do not carry a balance on their credit card.\",\"Frugal, they pay close attention to finances. Entertainment preferences are playing cards and reading books.\",\"Many residents are dependent on Medicare and Medicaid for health care expenses.\",\"Usually own a truck. Participate in fishing and hunting. Own a pet, commonly a dog.\",\"They own a riding lawn mower, as well as a garden tiller, and have vegetable gardens.\",\"Own a domestic truck, dog, and ATV. Hunting, yard work, and gardening popular activities.\",\"Likely to have purchased a used vehicle in the past year, maintaining the vehicle themselves. Participate in fishing and hunting.\",\"Typical of their country lifestyle, Rural Bypasses residents prefer trucks over sedans.\",\"Once in a while, they do watch a movie at the theater, but prefer to catch movies on premium TV channels such as HBO, Starz, and Showtime.\",\"Use their cell phone to text, listen to music, pay bills, redeem coupons, look up directions, and access financial information.\",\"They spend money readily on what is hot unless saving for something specific.\",\"Prefer name brands, but buy generic when it is a better deal.\",\"While most residents obtain privately issued medical insurance plans, some are covered by Federal programs like Medicaid.\",\"Many have no financial investments or retirement savings.\",\"Tend to carry credit card balances, have personal loans, and pay bills in person.\",\"Community-oriented residents. More conservative than middle-of-the-road.\",\"This market lives for today, choosing to save only for a specific purpose.\",\"Limited funds to invest in retirement savings plans, stocks, or bonds.\",\"Family is reflected in purchases - baby products and apparel for children. Banking is done primarily in person. Savings and debt are minimal.\",\"They are automotive enthusiasts. If they had the savings, they would buy a used, but bold, fun-to-drive vehicle.\",\"Many residents used a debit card within the past year- some maintain a savings account. When possible, money is often wired to family abroad.\",\"Wage income is often supplemented by public assistance and Supplemental Security Income.\",\"Trucks, SUVs, and compact cars are popular vehicles in which to transport their growing families.\",\"Strong preference for environmentally friendly products and vehicles that get good gas mileage.\",\"Often purchase trendy clothes on a budget.\",\"NA\"]%nl%returnValue(segDef[int(!TAPESTRYNEWTOP1NUM!)-1])"}},"xmlString":"<span style=\"font-size:13px;font-family:Avenir Next;\">[CUSTOME598DF70150F4B47915A27094B49B509]</span>"}}}}],"style":{"width":310,"left":434,"top":396,"spaceAfter":0,"autoSizeRows":false},"attributes":{"noSorting":false,"noChartView":false}},{"id":"table","customName":"Trait 1","columns":[{"field":"field0","style":{"width":220}}],"rows":[{"style":{"fields":{"field0":{"horizontalAlign":"left","verticalAlign":"top","backgroundColor":"rgba(0, 0, 0, 0)","fontWeight":"normal","fontStyle":"normal","textDecoration":"none","color":"#4C4C4C","fontFamily":"Avenir Next","fontSize":13,"lineHeight":20}},"height":40},"fieldInfos":{"field0":{"isRichText":true,"richTextJson":{"fieldInfos":{"CUSTOM4D375FD9B9B44516908D3F3852031AE6":{"hasVariable":true,"name":"CUSTOM4D375FD9B9B44516908D3F3852031AE6","templateName":"dataCollectionsCalculator.CUSTOM4D375FD9B9B44516908D3F3852031AE6","alias":"College degree (%)","variableID":"CUSTOM4D375FD9B9B44516908D3F3852031AE6","fullName":"dataCollectionsCalculator.CUSTOM4D375FD9B9B44516908D3F3852031AE6","statefulName":"n/dataCollectionsCalculator.CUSTOM4D375FD9B9B44516908D3F3852031AE6","type":"esriFieldTypeDouble","showCurrency":false,"showPercent":true,"useThousandsSeparator":true,"decimals":1,"usedFields":["EDUCATIONALATTAINMENTASSCDEG_CY_P","EDUCATIONALATTAINMENTBACHDEG_CY_P","EDUCATIONALATTAINMENTGRADDEG_CY_P"],"expressionText":"!EDUCATIONALATTAINMENTASSCDEG_CY_P!+!EDUCATIONALATTAINMENTBACHDEG_CY_P!+!EDUCATIONALATTAINMENTGRADDEG_CY_P!"}},"xmlString":"<b>Education:</b><br/>[CUSTOM4D375FD9B9B44516908D3F3852031AE6] College degree (2+ years)"}}}}],"style":{"width":220,"left":811,"top":554,"spaceAfter":0,"autoSizeRows":false},"attributes":{"noSorting":false,"noChartView":false}},{"id":"table","customName":"Trait 4 icon","columns":[{"field":"field0","style":{"width":40}}],"rows":[{"style":{"fields":{"field0":{"horizontalAlign":"center","verticalAlign":"middle","backgroundColor":"rgba(0, 0, 0, 0)"}},"height":40},"fieldInfos":{"field0":{"isShape":true,"shapeJson":{"id":"shape","g":[{"name":"path","d":"M18 18.4912C18 16.8125 19.4766 15 21.8623 15H26v-3.2508c0-.3888-.438-.7492-.887-.7492H6.8144C6.3647 11 6 11.3604 6 11.7492V25.294c0 .3897.3647.7061.8144.7061H25.113c.449 0 .887-.3164.887-.706V22h-4.1377C19.4766 22 18 20.1787 18 18.4912zM21 13h2v1h-2v-1zm-4 0h2v1h-2v-1zm-6 11H9v-1h2v1zm0-10H9v-1h2v1zm4 10h-2v-1h2v1zm0-10h-2v-1h2v1zm4 10h-2v-1h2v1zm4 0h-2v-1h2v1zM19.75 5.5L13 10h10z"},{"name":"path","d":"M21.8628 16C20.1607 16 19 17.252 19 18.4912 19 19.729 20.1607 21 21.8628 21H27v-5h-5.1372zM21.5 19.825c-.7318 0-1.325-.5932-1.325-1.325s.5932-1.325 1.325-1.325 1.325.5932 1.325 1.325-.5932 1.325-1.325 1.325z"}],"viewBox":{"xmin":0,"ymin":0,"width":32,"height":32},"style":{"top":0,"left":0,"width":40,"height":40,"fillColor":"rgba(55, 196, 242, 1)","borderAlpha":0,"fillAlpha":1,"borderWidth":1,"angle":0},"preserveAspectRatio":"none"}}}}],"style":{"width":40,"left":387.5,"top":391,"spaceAfter":0,"autoSizeRows":false},"attributes":{"noSorting":false,"noChartView":false}},{"id":"table","customName":"Trait 2","columns":[{"field":"field0","style":{"width":310}}],"rows":[{"style":{"fields":{"field0":{"horizontalAlign":"left","verticalAlign":"top","backgroundColor":"rgba(0, 0, 0, 0)","fontWeight":"normal","fontStyle":"normal","textDecoration":"none"}},"height":50},"fieldInfos":{"field0":{"isRichText":true,"richTextJson":{"fieldInfos":{"CUSTOM251561B2E15C49509D44D3169BBDE414":{"hasVariable":true,"name":"CUSTOM251561B2E15C49509D44D3169BBDE414","templateName":"dataCollectionsCalculator.CUSTOM251561B2E15C49509D44D3169BBDE414","alias":"TOP1_Defintion","variableID":"CUSTOM251561B2E15C49509D44D3169BBDE414","fullName":"dataCollectionsCalculator.CUSTOM251561B2E15C49509D44D3169BBDE414","statefulName":"n/dataCollectionsCalculator.CUSTOM251561B2E15C49509D44D3169BBDE414","type":"esriFieldTypeString","usedFields":["TAPESTRYNEWTOP1NUM"],"expressionText":"segDef = [\"Top Tier is a highly educated, successful consumer market, more than one in three residents has a postgraduate degree.\",\"Consumers are highly qualified in the science, technology, law, or finance fields. They have worked hard to build their prof reputation.\",\"Boomburbs residents prefer late model imports, primarily SUVs, and also luxury cars and minivans.\",\"Residents prefer late model, family-oriented vehicles - SUVs, minivans, and station wagons.\",\"Consumers are more interested in quality than cost. They take pride in their homes and foster a sense of personal style.\",\"Residents are employed in white collar occupations - in managerial, technical and legal positions.\",\"Not cost-conscious, these consumers willing to spend more for quality and brands they like.\",\"They keep up-to-date with the latest styles and trends, as well as the latest technology.\",\"At home, they enjoy the Internet and TV on high-speed connections with premier channels and services.\",\"Salaries are the primary source of income for most households, but self-employment income  and investment income complement salaries .\",\"Well-educated consumers, many currently enrolled in college.\",\"Image is important to these consumers. They use the Internet to keep up with the latest styles and trends and shop around for good deals.\",\"Most households have 2 or 3 vehicles.  Residents often have long travel time to work.\",\"They like to work from home, when possible. Otherwise they have long commuting times.\",\"Traditional values are the norm here - faith, country, and family. Sports include hunting, fishing, bowling, and baseball.\",\"Empty Nesters residents are physically and financially active. Residents enjoy listening to sports radio or watching sports on television.\",\"Homes integral part of their style. Invest in home remodeling and maintenance, DIY or contractors. Housekeeping is hired.\",\"The work force is diverse. Professionals in health care, retail trade, and education, or skilled workers in manufacturing and construction.\",\"Family-oriented consumers who value time spent at home. Most have lived, worked, and played in the same area for years.\",\"DIY enthusiasts that spend on home improvement and gardening. Leisure activities include movies at home, reading, fishing, and golf.\",\"Residents are active in their communities and a variety of social organizations, from charitable to veterans clubs.\",\"Steady employment in construction, manufacturing, and related service industries. Spending time with family is their top priority.\",\"Typical of neighborhoods with older residents, retirement income is common, but  also derive income from self-employment and investments.\",\"Faith and religion are important to these residents. Leisure activities include fishing, hunting, boating, and camping.\",\"Residents are close to retirement. They have accumulated wealth and begun to shift their portfolios to low-risk assets.\",\"The rural economy of this market provides employment in the manufacturing, construction, utilities, healthcare, and agriculture industries.\",\"Young families still feathering the nest and establishing their style. Most households have 2 ormore workers.\",\"This market includes recent immigrants and some language barriers.\",\"Most Urban Edge Families residents derive income from wages or salaries.\",\"Most Forging Opportunity residents live within the urban periphery of larger metropolitan areas across the South and West.\",\"Primarily skilled work force, many in agriculture. Spending time with family is a top priority.\",\"Many residents were born abroad and many households have residents who speak only Spanish.\",\"Residents are traditional in many ways. They rarely carry a credit card balance but occasionally buy on credit.\",\"Utilize home cleaning services so there is time for yoga. Attend venues like art galleries, museums - at home they like to cook and bake.\",\"Enjoy a variety of sports, including backpacking, rock climbing,, running, and yoga. Find leisure by going to clubs and attending concerts.\",\"Busy consumers, often feeling overwhelmed, with longer work commutes. Avid about recycling and love their electric juicer.\",\"Composed of a blue-collar work force with a strong labor force participation rate.\",\"Residents have a strong sense of community. They volunteer for charities, help fund raise, and recycle.\",\"Higher rates of employment in Manufacturing. Wages and salaries are the primary source of income.\",\"Primarily retired, but many still active in the labor force. Self-employment is the highest across all Tapestry markets.\",\"These neighborhoods are found in large metropolitan areas, outside central cities. Active social lives include travel, especially abroad.\",\"Predominantly retirees  with low labor force participation . Those who are still in the labor force tend to be self-employed or part-timers.\",\"Labor force participation is low and many households are drawing Social Security income.\",\"Enjoy hard-cover books, book clubs, crossword puzzles, and Sudoku. Prefer watching cable TV, including premium channels like HBO.\",\"These aging consumers rely mostly on Social Security income but also depend on Supplemental Security Income and public assistance.\",\"Prefer to listen to country music and watch Country Music Television and read fishing-hunting and home service magazines.\",\"These communities are heavily influenced by religious faith and family history.\",\"They hold strong religious beliefs. Many residents did not go to college.\",\"Family-oriented, outgoing consumers.  They place importance on preserving time-honored customs.\",\"Religion and faith are central in their lives. Income is primarily derived from wages and supplemented with Supplemental Security Incomes.\",\"Residents rely on wage and salary income. Residents work in health care, transportation, social services, and protective services.\",\"Residents like to read magazines, especially digital, covering topics ranging from news, fashion, to music.\",\"They work hard to advance in their professions, including working weekends. Enjoy watching MTV, BET, Spanish TV networks, and Tru TV.\",\"Residents are educated and mobile.  Many are enrolled in college and maintain close relationships with family.\",\"Typical of the city, many households own either one vehicle or none, and use public transportation.\",\"A strong focus is on religion and character. Style and appearance are important.\",\"Most neighborhoods are located in lower-density urban clusters of metro areas throughout the Midwest and South.\",\"Small Town Simplicity features a semirural lifestyle, complete with domestic trucks and SUVs, ATVs, and vegetable gardens.\",\"Consumers in this market consider traditional gender roles and religious faith very important.\",\"Hard-working consumers, striving to get ahead - style matters to them.\",\"Family market, primarily married couples with children, but also a number of multigenerational households.\",\"Working full-time in blue collar jobs, this market works hard. They seek adventure and take risks for the betterment of their families.\",\"Supporting large families, many earners will take on overtime work when possible.\",\"High Rise Renters are risk takers, and believe life should be as much fun as possible.\",\"These young residents maintain a healthy and active lifestyle that includes participating in sports and exercise.\",\"This market is bike and pedestrian friendly. Off-campus, low rent apartments comprise much of the housing stock.\",\"With limited parking on campus, many walk, bike, or car pool to class.\",\"NA\"]%nl%returnValue(segDef[int(!TAPESTRYNEWTOP1NUM!)-1])"}},"xmlString":"<span style=\"font-size:13px;font-family:Avenir Next;\">[CUSTOM251561B2E15C49509D44D3169BBDE414]</span>"}}}}],"style":{"width":310,"left":434,"top":241,"spaceAfter":0,"autoSizeRows":false},"attributes":{"noSorting":false,"noChartView":false}},{"id":"table","customName":"Trait 3 icon","columns":[{"field":"field0","style":{"width":35}}],"rows":[{"style":{"fields":{"field0":{"horizontalAlign":"center","verticalAlign":"middle","backgroundColor":"rgba(0, 0, 0, 0)"}},"height":35},"fieldInfos":{"field0":{"isShape":true,"shapeJson":{"id":"shape","g":[{"name":"path","d":"M7.833313,14H17v1H8H7L5.166687,4H3V3h2h1l0.5,3H19l-3,7H7.666687L7.833313,14z M9,17.593832v-0.187664   C9,16.6295624,8.3704367,16,7.5938315,16H7.4061685C6.6295633,16,6,16.6295624,6,17.406168v0.187664   C6,18.3704376,6.6295633,19,7.4061685,19h0.1876631C8.3704367,19,9,18.3704376,9,17.593832z M17,17.593832v-0.187664   C17,16.6295624,16.3704376,16,15.5938311,16h-0.1876621C14.6295633,16,14,16.6295624,14,17.406168v0.187664   C14,18.3704376,14.6295633,19,15.4061689,19h0.1876621C16.3704376,19,17,18.3704376,17,17.593832z"}],"viewBox":{"xmin":2,"ymin":2,"width":18,"height":18},"style":{"top":0,"left":0,"width":35,"height":35,"fillColor":"rgba(55, 196, 242, 1)","borderAlpha":0,"fillAlpha":1,"borderWidth":1,"angle":0},"preserveAspectRatio":"none"}}}}],"style":{"width":35,"left":389.5,"top":315.5,"spaceAfter":0,"autoSizeRows":false},"attributes":{"noSorting":false,"noChartView":false}},{"id":"table","customName":"Trait 3","columns":[{"field":"field0","style":{"width":310}}],"rows":[{"style":{"fields":{"field0":{"horizontalAlign":"left","verticalAlign":"top","backgroundColor":"rgba(0, 0, 0, 0)","fontWeight":"normal","fontStyle":"normal","textDecoration":"none"}},"height":50},"fieldInfos":{"field0":{"isRichText":true,"richTextJson":{"fieldInfos":{"CUSTOM91A15B1995B147958C6A77C2B54C3C20":{"hasVariable":true,"name":"CUSTOM91A15B1995B147958C6A77C2B54C3C20","templateName":"dataCollectionsCalculator.CUSTOM91A15B1995B147958C6A77C2B54C3C20","alias":"TOP1_Defintion2","variableID":"CUSTOM91A15B1995B147958C6A77C2B54C3C20","fullName":"dataCollectionsCalculator.CUSTOM91A15B1995B147958C6A77C2B54C3C20","statefulName":"n/dataCollectionsCalculator.CUSTOM91A15B1995B147958C6A77C2B54C3C20","type":"esriFieldTypeString","usedFields":["TAPESTRYNEWTOP1NUM"],"expressionText":"segDef = [\"Consumers spend money on themselves. They frequently visit day spas and salons, and exercise at exclusive clubs.\",\"Consumers spend on credit but have the disposable income to avoid a balance on their credit cards. They spend heavily on Internet shopping.\",\"Style matters in the Boomburbs, from personal appearance to their homes. Consumers are still furnishing their new homes and already remodeling.\",\"Informed shoppers that do their research prior to purchasing and focus on quality.\",\"Gardening and home improvement are priorities, but they also use a number of services, from home care and maintenance to personal care.\",\"These consumers shop at Trader Joes, Costco, or Whole Foods.\",\"Many professionals in finance, information technology, education, or management.\",\"Favor trendier stores for appare - Costco and specialty markets for groceries.\",\"Convenience is key-shop at Amazon.com and pick up medicines at the Target pharmacy. Buy name brands and trendy clothes online.\",\"Environmentally conscientious but also image-conscious - both impact their purchasing.\",\"Shop at Trader Joes and Whole Foods for groceries - partial to organic foods. Prefer environmentally safe products.\",\"These consumers shop at Whole Foods or Trader Joes and buy organic. Their cart is more often filled with prepared or ready-to-heat meals.\",\"Family-oriented purchases and activities dominate, TVs, movie purchases, children apparel and toys, and visits to theme parks or zoos.\",\"Frequently buy clothes and toys for children. Enjoy dining at Chilis, Chick-fil-A, and KFC.\",\"Prefer to buy American and for a good price. Media preferences include country and Christian channels.\",\"Home maintenance a priority among these homeowners. Physically active, they play golf, ski, ride bicycles, and work out regularly.\",\"Attentive to price, they use coupons,. Partial to late model and compact SUVs. Generous with support of various charities and causes.\",\"Budget-conscious consumers stock up on staples at warehouse clubs. Residents are more likely to buy SUVs or trucks over compact cars.\",\"Budget aware shoppers that favor American-made products. Residents take advantage of convenience stores for picking up incidentals.\",\"Attentive to price, but not at the expense of quality, they prefer to buy American and natural products.\",\"They are cautious consumers with a focus on quality and durability. Purchasing choices reflect Green Acres residents country life.\",\"Cost-conscious consumers, loyal to brands they like, with a focus on buying American.\",\"Residents are very do-it-yourself oriented and cost conscious.\",\"Tend to buy things when they need them, rather than when they want them or to be trendy. Walmart is a favorite shopping stop.\",\"They shop for  clothing when something needs replaced. They pay little attention to advertising and usually stick to the brands they know.\",\"These are budget savvy consumers. They stick to brands they grew up with - know the price of goods. Buying American is important.\",\"Careful shoppers, aware of prices, willing to shop around for the best deals and open to influence by other opinions.\",\"Fashion matters to residents, who spend liberally on new clothes for the whole family. Brand conscious but not necessarily brand loyal.\",\"They tend to spend money carefully and focus more on necessities.\",\"Residents shop at discount and department stores like Walmart, Dollar General, and JC Penney for baby and children products.\",\"They are cost-conscious consumers. Favor shopping at Costco, Home Depot, Old Navy, Walmart, Dollar Tree, and Target.\",\"Often, purchase decisions are based on how a product may improve their lives. Shop at dollar stores and discount department stores.\",\"Price-conscious consumers, they seek out deals on brands they like at warehouse clubs, Marshalls, Target, or Bed, Bath and Beyond.\",\"Consumers research products carefully before making purchases. They shop at Trader Joes and Whole Foods.\",\"Concern about the environment impacts their purchasing decisions.\",\"Careful shoppers, use coupons, demonstrating some brand loyalty. Try to buy low-calorie food, but enjoy pizza  and occasional fast-food stops.\",\"Price is more important than brand names or style to these consumers. With limited incomes, these are not adventurous shoppers.\",\"Consumers are price aware and coupon clippers, but open to impulse buys.\",\"Purchase sale items in bulk and buy generic over brands. Shop at their local discount store or search for bargains on the Internet.\",\"Partial to luxury cars or SUVs - highest demand market for convertibles. Generous supporters of charitable organizations.\",\"They are generous supporters of the arts and charitable organizations. Leisure time is spent on sports (tennis, golf or walking).\",\"These consumers focus on price, but not at the expense of quality. They use coupons and buy American and environmentally safe products.\",\"They are limited by medical conditions but still enjoy gardening and working on their vehicles.\",\"Shop at diverse, large retail chains like Target, and Walmart for convenience. Contribute to political organizations and other groups.\",\"With fixed incomes, consumers remain price sensitive.\",\"These consumers are more concerned about cost rather than quality or brand loyalty. Use Walmart for all their shopping needs.\",\"When shopping, they look for American-made and generic products. Many are on Medicare and frequent the Walgreens pharmacy.\",\"They make purchases for today because tomorrow is uncertain. Shop at department and discount stores.\",\"Frequent Walmart Supercenters, Walgreens, dollar stores,  and Big Lots for all their shopping needs.\",\"To save money, households shop at discount department stores, such as Walmart, and warehouse clubs.\",\"They prefer to shop around for clearance deals on branded apparel at Marshalls or Old Navy, sometimes shopping at Abercrombie.\",\"These careful shoppers are aware of prices, and demonstrate little brand loyalty.\",\"They take pride in their appearance, consider their fashion trendy, and stick with the same few designer brands.\",\"Prefer shopping for bargains at Walmart, including discount stores like Big Lots, and the local dollar store.\",\"Shop primarily at warehouse clubs like WalMart Super Centers, and discount department stores such as Old Navy and Burlington.\",\"Shop at discount stores, such as Marshalls, dollar stores, and take advantage of savings at WalMart.\",\"Cost-conscious consumers are comfortable with brand loyalty, unless the price is too high. Convenience stores are used to pick up incidentals.\",\"Price-conscious consumers that shop accordingly, with coupons at discount centers.\",\"Consumers shop at warehouse clubs and low-cost retailers.\",\"Shop for groceries at warehouse and club stores, as well as specialty markets.\",\"Brand loyalty and environmentally safe products also guide purchasing choices, although these consumers are open to new products.\",\"A large portion of their income goes toward baby and children products - disposable diapers, baby food, furniture and eqipment.\",\"Price-conscious consumers that budget for fashion, not branding. However, parents are happy to spoil their brand savvy children.\",\"Shop at Target more often than Walmart due to their location in city markets. Shop at Marshalls  and Foot Locker.\",\"Shopping for baby products at major discount department stores or Amazon.com is common, as is shopping at the military commissary.\",\"Limited incomes result in thrifty purchases.\",\"Impulse buyers who experiment with different brands. Rely on Internet shopping to express appearance and fashion preferences.\",\"NA\"]%nl%returnValue(segDef[int(!TAPESTRYNEWTOP1NUM!)-1])"}},"xmlString":"<span style=\"font-size:13px;font-family:Avenir Next;\">[CUSTOM91A15B1995B147958C6A77C2B54C3C20]</span>"}}}}],"style":{"width":310,"left":434,"top":318,"spaceAfter":0,"autoSizeRows":false},"attributes":{"noSorting":false,"noChartView":false}},{"id":"table","customName":"Trait 5 icon","columns":[{"field":"field0","style":{"width":40}}],"rows":[{"style":{"fields":{"field0":{"horizontalAlign":"center","verticalAlign":"middle","backgroundColor":"rgba(0, 0, 0, 0)"}},"height":40},"fieldInfos":{"field0":{"isShape":true,"shapeJson":{"id":"shape","g":[{"name":"path","d":"M4 14h5v2H4zm7.0479 7.4839c-1.0817.27-1.935.83-2.3625 1.5161h16.285c.0333-.1761.0457-.3535.0296-.538-.0916-1.0287-1.0184-1.8115-2.5751-1.9377.1134-.228.1648-.4754.143-.7279-.0825-.  their meals at home, attentive to good nutrition and fresh organic foods.\",\"Fnd time in their busy schedules for themselves. Work out in their home gyms, owning a treadmill or elliptical - or visit the salon and spa.\",\"Leisure includes a range of activities from sports (hiking, bicycling, swimming, golf) to visits to theme parks or water parks.\",\"Foodies - they like to cook and prefer natural or organic products.\",\"Attentive to ingredients, they prefer natural or organic products.\",\"Eat organic foods, drink imported wine, and truly appreciate a good cup of coffee.\",\"Enjoy outdoor gardening, going to the beach, visiting theme parks, frequenting museums, and attending rock concerts.\",\"Enjoy eating out at family restaurants, stopping by Starbucks for coffee, listening to all news, contemporary, and hit radio music.\",\"Strive to stay youthful and healthy, eat organic and natural foods, run and do yoga.\",\"These are health-conscious consumers, who exercise regularly and pay attention to the nutritional value of the food they purchase.\",\"Very interested in the fine arts and strive to be sophisticated - value education and creativity.\",\"Attentive to good health and nutrition. Socially and environmentally conscious - willing to pay more for products that support their causes.\",\"Outdoor activities and sports are popular. Like to eat out, as well as participate bicycling, jogging, golfing, and boating.\",\"They spend heavily on eating out, at both fast-food and family restaurants.\",\"Entertainment is primarily family-oriented, TV and movie rentals or theme parks and family restaurants.\",\"Prefer eating at home instead of dining out.\",\"Prefer organic foods, including growing their own vegetables.\",\"Convenience is important in the kitchen, they regularly use frozen or packaged meals. Ground coffee is preferred over coffee beans.\",\"Favorite family restaurants include Applebees, Arbys, and Texas Roadhouse.\",\"Contribute to arts and cultural, educational, health, and social services organizations. Media preferences are country or movie channels.\",\"Residents pursue physical fitness , from working out on home exercise equipment to playing a variety of sports and eating wholesome food.\",\"Try to eat healthy, tracking the nutrition and ingredients in the food they purchase.\",\"Enjoy outdoor activities such as hiking, hunting,  and fishing. Residents are members of AARP and veterans clubs and support civic causes.\",\"Creatures of habit when purchasing food items.\",\"Simple tastes and modesty characterize these blue collar residents.\",\"They enjoy country music and watch CMT. Motorcycling, hunting, and fishing are popular - walking is the main form of exercise.\",\"Find leisure in family activities, movies at home, trips to theme parks or the zoo, and sports  from golfing, weight lifting, to taking a jog or run and drinking coffee.\",\"Leisure includes family activities like going to theme parks, watching movies, and gardening, plus sports like soccer and basketball.\",\"When dining out, these residents favor fast-food (Taco Bell), as well as family-friendly restaurants like Olive Garden or IHOP.\",\"Residents balance their budgets carefully by spending only on necessities and limiting activities like dining out.\",\"Key expenditures include groceries and products for their children.\",\"Baby and children products, such as food, clothing, and furniture, are common purchases.\",\"Attuned to nature and the environment, they purchase natural products, vitamins, low-sodium foods, and are exercising throughout the week.\",\"They buy natural, green, and environmentally friendly products.  Very conscious of nutrition, they regularly buy and eat organic foods.\",\"Eat out often at fast-food and family restaurants.\",\"Enjoy dancing, eating out at their favorite family restaurants, and playing sports (such as volleyball, baseball, and soccer).\",\"They would rather cook a meal at home than dine out. The drink energy and sports drinks.\",\"Food features convenience, frozen and fast food.\",\"For those with young children, watching Disney and Nickelodeon on TV is popular. Diapers and baby food are priority expenditures.\",\"Active seniors that maintain a regular exercise regimen and pay attention to healthier eating habits.\",\"Good health is a priority. They believe in healthy eating, coupled with vitamins and dietary supplements.\",\"Avid readers, with audio books and e-readers. Cable TV is also a must, primarily watching news, movie, golf, weather, and food channels.\",\"Frequently dine out at Wendy s, Golden Corral, and Cracker Barrel.\",\"They are health conscious and prefer name brand drugs.\",\"Rather than eat out, residents prefer to have their meals at home, whether they order takeout or warm up a frozen dinner.\",\"Partial to eating at low-cost family restaurants and drive-ins.\",\"Leisure activities include hunting and fishing.\",\"Dine at Dairy Queen, Pizza Hut, Sonic Drive-ins, and Golden Corral. Budgeted vacations are taken within the US, not abroad.\",\"Favorite fast food - burgers and pizza. Often prepare quick meals, using packaged or frozen dinner entrees.\",\"Regularly watch sports programming as well as their favorite shows on CMT, ABC Family, USA Network, and Food Network.\",\"These image-conscious consumers indulge in pedicures and manicures, purchase tooth whiteners, and exercise to stay in shape.\",\"Purchase natural-organic food, but frequent fast food restaurants.\",\"Often eat frozen dinners, but when dining out prefer McDonalds, Taco Bell, Burger King, and Pizza Hut.\",\"Quick meals on the run are a reality of life.\",\"Many families prefer the convenience of fast-food restaurants to cooking at home.\",\"Magazines and entertainment, particularly focusing on health and children, are popular.\",\"Shop for groceries at discount stores such as Walmart supercenters.\",\"Many residents favor convenience over cooking - frozen meals and fast food.\",\"This market supports multigenerational families - are often primary caregivers for elderly family members.\",\"Preserving the environment and being in tune with nature are very important.\",\"Recent purchases reflect personal style - apparel, personal care products like hair coloring and tooth whiteners.\",\"NeWest Residents consumers love their caffeine - drinking coffee, sodas, sports, and energy drinks. Fast food dining is a big hit.\",\"Fresh Ambitions residents must budget for baby food and disposable diapers. Baby and parenthood magazines are their chosen reading material.\",\"Many are primary caregivers to elderly family members.\",\"Residents are active in their communities - eating together, attending meetings,  school affairs and engaging in fund-raising.\",\"Go out to the movies and out for drinks. Prefer to watch movies and TV programs online.\",\"Socializing, having fun, and learning new things are valued. With little experience cooking, fast food and frozen dinners are the go-to.\",\"NA\"]%nl%returnValue(segDef[int(!TAPESTRYNEWTOP1NUM!)-1])"}},"xmlString":"<span style=\"font-size:13px;font-family:Avenir Next;\">[CUSTOM8AF64E01107A4405B1D47D34B3811F19]</span>"}}}}],"style":{"width":310,"left":434,"top":473,"spaceAfter":0,"autoSizeRows":false},"attributes":{"noSorting":false,"noChartView":false}},{"id":"table","customName":"Trait 6 icon","columns":[{"field":"field0","style":{"width":40}}],"rows":[{"style":{"fields":{"field0":{"horizontalAlign":"center","verticalAlign":"middle","backgroundColor":"rgba(0, 0, 0, 0)"}},"height":40},"fieldInfos":{"field0":{"isShape":true,"shapeJson":{"id":"shape","g":[{"name":"path","d":"M31.833 8.6187c0-4.1094-4.8398-7.4522-10.789-7.4522-5.9483 0-10.7881 3.3428-10.7881 7.4522 0 .7839.1848 1.5446.5256 2.2756.723-.088 1.4611-.1443 2.2185-.1443 5.356 0 9.9697 2.2971 12.0563 5.5873.1162.1423.2522.2752.3587.4219l.4454.1597 3.329.9405-1.0996-3.5874c2.3848-1.4146 3.7432-3.4575 3.7432-5.6533z"},{"name":"path","d":"M4 30l1.206-3.4504C2.5278 24.9803 1 22.705 1 20.26 1 15.7057 6.3832 12 13 12s12 3.7057 12 8.2601S19.6168 28 13 28c-.8547 0-2.3149-.1685-2.7368-.2196L4 30z"}],"viewBox":{"xmin":0,"ymin":-1,"width":32,"height":32},"style":{"top":0,"left":0,"width":40,"height":40,"fillColor":"rgba(55, 196, 242, 1)","borderAlpha":0,"fillAlpha":1,"borderWidth":1,"angle":0},"preserveAspectRatio":"none"}}}}],"style":{"width":40,"left":387.5,"top":554,"spaceAfter":0,"autoSizeRows":false},"attributes":{"noSorting":false,"noChartView":false}},{"id":"table","customName":"Trait 6","columns":[{"field":"field0","style":{"width":310}}],"rows":[{"style":{"fields":{"field0":{"horizontalAlign":"left","verticalAlign":"top","backgroundColor":"rgba(0, 0, 0, 0)","fontWeight":"normal","fontStyle":"normal","textDecoration":"none"}},"height":50},"fieldInfos":{"field0":{"isRichText":true,"richTextJson":{"fieldInfos":{"CUSTOM69A678254BAC46F9B732ED6AA4BE32AD":{"hasVariable":true,"name":"CUSTOM69A678254BAC46F9B732ED6AA4BE32AD","templateName":"dataCollectionsCalculator.CUSTOM69A678254BAC46F9B732ED6AA4BE32AD","alias":"TOP1_Defintion5","variableID":"CUSTOM69A678254BAC46F9B732ED6AA4BE32AD","fullName":"dataCollectionsCalculator.CUSTOM69A678254BAC46F9B732ED6AA4BE32AD","statefulName":"n/dataCollectionsCalculator.CUSTOM69A678254BAC46F9B732ED6AA4BE32AD","type":"esriFieldTypeString","usedFields":["TAPESTRYNEWTOP1NUM"],"expressionText":"segDef = [\"They make several domestic and foreign trips a year for leisure and pay for every luxury along the way-a room with a view, limousines, and rental cars are part of the package.\",\"Residents, both young and old, are tech savvy. They not only own the latest and greatest in tablets, smartphones, and laptops but actually use the features each has to offer.\",\"Well connected, own the latest devices and understand how to use them efficiently - biggest complaints-too many devices and too many intrusions on personal time.\",\"Well-connected consumers that appreciate technology and make liberal use of it for everything from shopping and banking to staying current and communicating.\",\"Exurbanites residents are well connected, using the Internet for everything from shopping to managing their finances.\",\"Avid book readers of both digital and audio formats.\",\"Use all types of media equally (newspapers, magazines, radio, Internet, TV).\",\"Own iPads and newer Mac computers. Use the Internet to visit chat rooms, watch TV programs and movies, trade and track investments, and make purchases.\",\"Early adopters of new technology in hopes of impressing peers with new gadgets.\",\"Use their laptops, iPads, and mobile phones extensively to stay connected.\",\"Favorite websites are Facebook, Twitter, YouTube, and LinkedIn.\",\"Up-to-date on technology, they explore and exploit all the features of their smartphones.\",\"Connected, with a host of wireless devices - anything that enables convenience, like banking, paying bills, or even shopping online.\",\"Very comfortable with new technology and embrace the convenience of completing tasks on a mobile device.\",\"Comfortable with the latest in technology, for convenience (online banking or saving money on landlines) and entertainment.\",\"Spending a lot of time online is not a priority, so most own older home computers.\",\"Connected and knowledgeable, they carry smartphones and use many of the features.\",\"These residents tend to use their cell phones for calls and texting only. Pass time at home watching documentaries on Animal Planet, Discovery, or History channels.\",\"Read newspapers, especially the Sunday editions. Residents are connected-entertainment activities like online gaming dominate their Internet usage.\",\"Traditional, not trendy - opt for convenience and comfort, not cutting-edge. Technology has its uses, but the bells and whistles are a bother.\",\"Comfortable with technology, more as a tool than a trend. Banking or paying bills online is convenient, but the Internet is not viewed as entertainment.\",\"Last to buy the latest and greatest products. These conservative consumers prefer to conduct their business in person rather than online.\",\"Technology is not central in their lives - light use of Internet connectivity for shopping to entertainment.\",\"Somewhat resistant to new technology. They read the local newspaper as well as home service, and fishing and hunting magazines.\",\"Many residents have satellite dishes. They do not access the Internet often, but will make online purchases for items difficult to find in nearby stores.\",\"Residents trust TV and newspapers more than any other media.\",\"Rely on the Internet for entertainment, information, shopping, and banking.\",\"Comfortable with technology and interested in the latest innovations.\",\"They are captivated by new technology, particularly feature-rich smartphones.\",\"Many households subscribe to satellite television to watch their favorite programs. Magazines are extremely popular sources of news and the latest trends.\",\"They use TV more than any other media to stay informed. Minimal online usage. Listen to a variety of music, especially Spanish-Latin music.\",\"Television is a primary source of entertainment, and most homes have multiple sets. Most households have landlines-used frequently for international calls.\",\"Although most still own landlines, they use their cell phones frequently from news to entertainment to redeeming mobile coupons.\",\"They are interested in the fine arts and especially enjoy listening to music.\",\"These consumers are up on the latest technology. They use mobile devices to access YouTube or Facebook and play games.\",\"Get news and information from various forms of media (newspapers, radio, TV, and Internet).\",\"Go online for gaming, watching movies, employment searches, and posting pics on social media. Watch Comedy Central, Nickelodeon, and PBS Kids Sprout.\",\"They are comfortable with the latest technology. They prefer cell phones to landlines.\",\"Read parenting and health magazines. Watch programs on BET, VH1, and Game Show Network.\",\"Connected, but primarily to get news and track investments, more likely to own an e-reader or tablet than a smartphone.\",\"These consumers are well connected. Internet access is used for everything from shopping or paying bills to monitoring investments and entertainment.\",\"Cell phones are common but primarily used to make and receive calls.\",\"Get most information from TV and the Sunday newspaper - light users of home computers and the Internet.\",\"They prefer reading magazines over interacting with computers.\",\"A trusted source of information, TV is an important part of their lives. They steer away from cell phones, computers.\",\"They tend to be somewhat late in adapting to technology. They obtain a disproportionate amount of their information from TV, compared to other media.\",\"Often find computers and cell phones too complicated and confusing.\",\"They are slow to adopt technology. TV is the main source of information, news, and entertainment.\",\"Use the Internet to stay connected with friends and play online video games.\",\"They rely on television to stay informed.\",\"Bundled with their cable service, most residents have high-speed Internet access on their older desktops.\",\"Like to be the first to try new products, but prefer to do research before buying the latest electronics. No landline telephone for majority of HHs, preferring a cell phone only.\",\"Younger residents are highly connected, while older residents do not have much use for the latest and greatest technology.\",\"Use the Internet for social media, downloading video games, and watching TV programs.\",\"Subscribe to cable TV - children-oriented programs are popular, as are game shows and movie channels.\",\"Connected, using the Internet primarily for entertainment, chat, and online gaming.\",\"Connected and comfortable with the Internet, more likely to participate in online gaming or posting pics on social media.\",\"Rely on television or newspapers to stay informed.  Watch NASCAR and college football and basketball on TV.\",\"Consumers favor TV as their media of choice and will purchase a product with a celebrity endorsement.\",\"Media used most often is the Internet. Use the Internet to visit Spanish language websites and download music, access social media sites, watch movies, and play games.\",\"Use, but do not rely on, technology.\",\"Prefer watching Spanish language channels over watching sports on TV, or listening to popular music.\",\"These young, newly established residents own cell phones, not landlines.\",\"TV buffs whose favorites include Spanish language programming, BET, as well as shows and movies on HBO, Starz, and Showtime.\",\"Consumers are comfortable with personal computers and use the Internet for a host of activities, such as entertainment, shopping, making travel arrangements, and paying bills.\",\"Most feel anything that can be done online is easier than in person. Own laptops and notebooks and video game systems.\",\"Always connected - their cell phone is never out of reach.\",\"NA\"]%nl%returnValue(segDef[int(!TAPESTRYNEWTOP1NUM!)-1])"}},"xmlString":"<span style=\"font-size:13px;font-family:Avenir Next;\">[CUSTOM69A678254BAC46F9B732ED6AA4BE32AD]<br/></span>"}}}}],"style":{"width":310,"left":434,"top":554,"spaceAfter":0,"autoSizeRows":false},"attributes":{"noSorting":false,"noChartView":false}},{"id":"table","customName":"Facts tab background","columns":[{"field":"field0","style":{"width":329}}],"rows":[{"style":{"fields":{"field0":{"horizontalAlign":"center","verticalAlign":"middle","backgroundColor":"rgba(0, 0, 0, 0)"}},"height":62},"fieldInfos":{"field0":{"isShape":true,"shapeJson":{"id":"shape","g":[{"name":"path","d":"M0 0v64h64V0H0z"}],"viewBox":{"xmin":0,"ymin":0,"width":64,"height":64},"style":{"top":0,"left":0,"width":329,"height":62,"fillColor":"#000000","borderAlpha":0,"fillAlpha":1,"borderWidth":1,"angle":0},"preserveAspectRatio":"none"}}}}
