roommates. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"ATRISKAVGHHSZ_CY":{"type":"number","alias":"2023 Average Household Size","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of Average Household Size in the geographic area. The Average Household Size is calculated by dividing the number of persons living in households by the total number of households in the current year. Households include all the people who occupy a housing unit (such as a house or apartment) as their usual residence.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"DAYTIMEPOPULATIONDPOP_CY":{"type":"number","alias":"2023 Total Daytime Population","vintage":"2023","source":"Esri-Data Axle","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Total Daytime Population in the geographic area. Total Daytime Population includes workers (civilian, non-military employed at work, and armed forces personnel ages 16+) and residents (population age 0-15, unemployed adults, those not in the labor force, and employed civilians who are not working temporarily due to illness, vacation, etc.). See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"DAYTIMEPOPULATIONDPOPWRK_CY":{"type":"number","alias":"2023 Daytime Pop: Workers","vintage":"2023","source":"Esri-Data Axle","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Daytime Population who are Workers in the geographic area. Daytime Workers include population age 16+ who are civilian, non-military at work (commuters and non-commuters), and armed forces (on and off base). See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"DAYTIMEPOPULATIONDPOPRES_CY":{"type":"number","alias":"2023 Daytime Pop: Residents","vintage":"2023","source":"Esri-Data Axle","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Daytime Population who are Residents in the geographic area. Daytime Residents include population age 0-15; unemployed adults; those not in the Labor Force such as retirees, homemakers, college students, residents of institutions and non-institutional group homes, detention centers and shelters; and employed civilians who are temporarily not working due to illness, vacation, bad weather, labor dispute, etc. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"POLICYHINC0_CY":{"type":"number","alias":"2023 HH Income <$15000","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the number of Households with Income <$15,000 in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"POLICYHINC15_CY":{"type":"number","alias":"2023 HH Income $15000-24999","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the number of Households with Income $15,000-$24,999 in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"POLICYHINC25_CY":{"type":"number","alias":"2023 HH Income $25000-34999","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the number of Households with Income $25,000-$34,999 in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"POLICYHINC35_CY":{"type":"number","alias":"2023 HH Income $35000-49999","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the number of Households with Income $35,000-$44,999 in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"POLICYHINC50_CY":{"type":"number","alias":"2023 HH Income $50000-74999","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the number of Households with Income $50,000-$74,999 in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"POLICYHINC75_CY":{"type":"number","alias":"2023 HH Income $75000-99999","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the number of Households with Income $75,000-$99,999 in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"POLICYHINC100_CY":{"type":"number","alias":"2023 HH Income $100000-149999","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the number of Households with Income $100,000-$149,999 in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"POLICYHINC150_CY":{"type":"number","alias":"2023 HH Income $150000-199999","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the number of Households with Income $150,000-$199,999 in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"POLICYHINC200_CY":{"type":"number","alias":"2023 HH Income $200000+","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the number of Households with Income $200,000+ in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"WEALTHWLTHINDXCY":{"type":"number","alias":"2023 Wealth Index","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Wealth Index summarizes the wealth of a geographic area relative to the national level. Wealth is calculated from a number of indicators of affluence that include household income and average net worth. The concept of wealth is defined by more than just above-average household income; it also includes the value and abundance of material possessions and resources. Esri captures both aspects in its identification of the wealthiest areas in the country. The national index value is set to 100: values exceeding 100 represent above-average wealth while values below 100 represent below-average wealth. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"HOUSINGUNITTOTALSHAI_CY":{"type":"number","alias":"2023 Housing Affordability Index","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Housing Affordability Index (HAI) measures the ability of a typical resident to purchase a home in the geographic area. The HAI has a base of 100, representing where the median income is sufficient to qualify for a loan on a median-valued home and not be cost-burdened (cost-burdened=greater than 30% of income spent on housing). HAI values > 100 indicate increasing affordability; HAI values < 100 indicate areas where homes are less affordable and median income might be insufficient to purchase a median-valued home.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"KEYUSFACTSDIVINDX_CY":{"type":"number","alias":"2023 Diversity Index","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 estimated Diversity Index in the geographic area. Esri's Diversity Index summarizes racial and ethnic diversity, indicating the likelihood that two individuals, chosen at random from the same area, belong to the same race or ethnic group. The index ranges from 0 (no diversity) to 100 (highest diversity). An area's Diversity Index increases when the population includes more race/ethnic groups. <a target='_blank' href='https://links.esri.com/diversity-index'>read more</a> See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"KEYUSFACTSMEDVAL_CY":{"type":"number","alias":"2023 Median Home Value","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Median Home Value in the geographic area. Median Home Value divides home values into two equal groups; half of the homes will have a value higher than the median, and half lower. If the median is $2,000,000+, it is represented by a value of $2,000,001.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"KEYUSFACTSPOPGRWCYFY":{"type":"number","alias":"2023-2028 Growth Rate: Population","vintage":"2028","source":"Esri","units":null,"decimals":null,"definition":"Esri 2028 five-year forecast for Population: Compound Annual Growth Rate (CAGR). The Population CAGR is an annualized measure that describes the direction (either positive or negative) and magnitude of change in the total Population between the years 2023 and 2028. The CAGR is sometimes referred to as growth rate, annual rate, annualized growth rate, or compound growth rate; reference the <a target='_blank' href='https://links.esri.com/esri-demographics/vocab'>CAGR variable formula</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"WEALTHVAL0_CY_P":{"type":"number","alias":"2023 Home Value <$50000: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the number of homes with Home Value <$50,000 in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"WEALTHVAL50K_CY_P":{"type":"number","alias":"2023 Home Value $50K-99999: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the number of homes with Home Value $50,000-$99,999 in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"WEALTHVAL100K_CY_P":{"type":"number","alias":"2023 Home Value $100K-149999: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the number of homes with Home Value $100,000-$149,999 in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"WEALTHVAL150K_CY_P":{"type":"number","alias":"2023 Home Value $150K-199999: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the number of homes with Home Value $150,000-$149,999 in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"WEALTHVAL200K_CY_P":{"type":"number","alias":"2023 Home Value $200K-249999: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the number of homes with Home Value $200,000-$249,999 in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"WEALTHVAL250K_CY_P":{"type":"number","alias":"2023 Home Value $250K-299999: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the number of homes with Home Value $250,000-$299,999 in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"WEALTHVAL300K_CY_P":{"type":"number","alias":"2023 Home Value $300K-399999: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the number of homes with Home Value $300,000-$399,999 in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"WEALTHVAL400K_CY_P":{"type":"number","alias":"2023 Home Value $400K-499999: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the number of homes with Home Value $400,000-$499,999 in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"WEALTHVAL500K_CY_P":{"type":"number","alias":"2023 Home Value $500K-749999: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the number of homes with Home Value $500,000-$749,999 in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"WEALTHVAL750K_CY_P":{"type":"number","alias":"2023 Home Value $750K-999999: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the number of homes with Home Value $750,000-$999,999 in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"WEALTHVAL1M_CY_P":{"type":"number","alias":"2023 Home Value $1 Million-1499999: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the number of homes with Home Value $1,000,000-$1,499,999 in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"HOMEVALUEVAL1PT5MCY_P":{"type":"number","alias":"2023 Home Value $1.5 Million-1999999: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the number of homes with Home Value $1,500,000-$1,999,999 in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"HOMEVALUEVAL2M_CY_P":{"type":"number","alias":"2023 Home Value $2 Million+: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the number of homes with Home Value ≥$2,000,000 in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"HISTORICALPOPULATIONTSPOP20_CY":{"type":"number","alias":"2020 Population (Esri 2023)","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Time Series: retroactive estimate of the Total Population on July 1, 2020. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"HISTORICALPOPULATIONTSPOP21_CY":{"type":"number","alias":"2021 Population (Esri 2023)","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Time Series: retroactive estimate of the Total Population on July 1, 2021. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"HISTORICALPOPULATIONTSPOP22_CY":{"type":"number","alias":"2022 Population (Esri 2023)","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Time Series: retroactive estimate of the Total Population on July 1, 2022. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"KEYUSFACTSTOTPOP_FY":{"type":"number","alias":"2028 Total Population","vintage":"2028","source":"Esri","units":null,"decimals":null,"definition":"Esri 2028 five-year forecast for the Total Population in the geographic area. Total Population includes population living in households, on active duty in the Armed Forces, and living in group quarters such as correctional facilities, skilled nursing facilities, juvenile facilities, military barracks, and college dorms.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"TAPESTRYHOUSEHOLDSNEWTHH01_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 1A: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Top Tier (1A) Tapestry Households in the geographic area. This market segment earns more than three times the U.S. Household Income. They have high purchasing power, but what do they truly want? <a target='_blank' href='https://links.esri.com/tapestry/segment1'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH02_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 1B: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Professional Pride (1B) Tapestry Households in the geographic area. This market segment is well-educated, career professionals who have prospered through the Great Recession. To maintain their upscale and typically suburban lifestyles, these goal oriented couples work long hours and often have lengthy commutes. <a target='_blank' href='https://links.esri.com/tapestry/segment2'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH03_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 1C: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Boomburbs (1C) Tapestry Households in the geographic area. This market segment consists of young professionals with families that have opted to trade up to the newest housing in the suburbs. Boomburbs neighborhoods began growing in the 1990s and have continued to expand. <a target='_blank' href='https://links.esri.com/tapestry/segment3'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH04_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 1D: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Savvy Suburbanites (1D) Tapestry Households in the geographic area. This market segment is well educated, well read, and well capitalized. Families include empty nesters or soon-to-be so with adult children at home located in older neighborhoods outside the urban core. <a target='_blank' href='https://links.esri.com/tapestry/segment4'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH05_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 1E: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Exurbanites (1E) Tapestry Households in the geographic area. This market segment is now approaching retirement but showing few signs of slowing down. Exurbanites are active in their communities, generous in their donations, and seasoned travelers who take advantage of their proximity to large metropolitan centers to support the arts. <a target='_blank' href='https://links.esri.com/tapestry/segment5'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH06_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 2A: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Urban Chic (2A) Tapestry Households in the geographic area. This market segment are professionals who live a sophisticated, exclusive lifestyle. Half of all households are occupied by married-couple families and approximately 30% are singles. These are busy, well-connected and well-educated consumers—avid readers and movie goers who are environmentally active. <a target='_blank' href='https://links.esri.com/tapestry/segment6'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH07_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 2B: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Pleasantville (2B) Tapestry Households in the geographic area. This market segment is best described as 'prosperous domesticity'. Situated principally in older housing in suburban areas of the Northeast, especially in New York and New Jersey, and secondarily in the West, particularly California, these are slightly older, well-off couples. <a target='_blank' href='https://links.esri.com/tapestry/segment7'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH08_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 2C: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Pacific Heights (2C) Tapestry Households in the geographic area. This small market segment (fewer than 1% of all households) is composed of upscale neighborhoods in the urban periphery of metropolitan areas along the Pacific Coast in California, Hawaii, and the Northeast. <a target='_blank' href='https://links.esri.com/tapestry/segment8'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH09_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 2D: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Enterprising Professionals (2D) Tapestry Households in the geographic area. This market segment is well-educated and climbing the ladder primarily in STEM (science, technology, engineering, or mathematics) occupations. They change jobs often and correspondingly often live in condominiums, town homes, or apartments. <a target='_blank' href='https://links.esri.com/tapestry/segment9'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH10_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 3A: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Laptops and Lattes (3A) Tapestry Households in the geographic area. This market segment is predominantly composed of single, well-educated professionals in business, finance, legal, computer, and entertainment occupations. They are affluent and partial to densely-populated city living—and its amenities. <a target='_blank' href='https://links.esri.com/tapestry/segment10'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH11_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 3B: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Metro Renters (3B) Tapestry Households in the geographic area. This market segment is highly mobile and educated, live alone or with a roommate in older apartment buildings or condominiums, frequently in the urban core of the city. Metro Renters is one of the fastest-growing market segments. <a target='_blank' href='https://links.esri.com/tapestry/segment11'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH12_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 3C: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Trendsetters (3C) Tapestry Households in the geographic area. This market segment could be labeled with the motto 'you're only young once'. Trendsetters live life to its fullest potential: educated young singles who are not yet ready to settle down, they do not own homes or vehicles and choose to spend their disposable income on upscale city living. <a target='_blank' href='https://links.esri.com/tapestry/segment12'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH13_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 4A: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Workday Drive (4A) Tapestry Households in the geographic area. This market segment is affluent, family-oriented with a country flavor. Residents are partial to new housing outside of the bustle of the city but close enough to commute to professional job centers. <a target='_blank' href='https://links.esri.com/tapestry/segment13'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH14_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 4B: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Home Improvement (4B) Tapestry Households in the geographic area. This market segment consists mostly of married-couple families in suburban households. Most Home Improvement residences are single-family homes that are Owner-Occupied, with only one-fifth of the households occupied by renters. <a target='_blank' href='https://links.esri.com/tapestry/segment14'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH15_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 4C: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Middleburg (4C) Tapestry Households in the geographic area. This market segment lives in neighborhoods that have been transformed from the easy pace of country life to semirural subdivisions within the past decade during the housing boom. Residents are typically traditional, family-oriented consumers who are still more country than rock-and-roll. <a target='_blank' href='https://links.esri.com/tapestry/segment15'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH16_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 5A: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Comfortable Empty Nesters (5A) Tapestry Households in the geographic area. This large, growing market segment is older, with more than half of all householders age 55 or older; many still live in the suburbs where they grew up. Comfortable Empty Nesters are mostly professionals working in government, health care, or manufacturing. These Baby Boomers earn a comfortable living. <a target='_blank' href='https://links.esri.com/tapestry/segment16'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH17_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 5B: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the In Style (5B) Tapestry Households in the geographic area. This market segment embraces an urbane lifestyle that includes supporting the arts, traveling, and extensive reading. They are connected and use the latest technology. Typically professional couples or single households without children, they have the time to focus on their homes. <a target='_blank' href='https://links.esri.com/tapestry/segment17'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH18_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 5C: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Parks and Rec (5C) Tapestry Households in the geographic area. This suburbanite market segment has achieved the dream of home ownership. Parks and Recs have purchased older, single-family homes, condominiums, or duplexes that are within their means. Many are two-income married couples approaching middle age. <a target='_blank' href='https://links.esri.com/tapestry/segment18'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH19_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 5D: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Rustbelt Traditions (5D) Tapestry Households in the geographic area. This market segment is the backbone of older industrial cities in states that surround the Great Lakes. Rustbelt Traditions are a mix of married-couple families and singles living in older developments of single-family homes. While somewhat varied, the work force has primarily white collar (office-based) occupations. <a target='_blank' href='https://links.esri.com/tapestry/segment19'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH20_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 5E: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Midlife Constants (5E) Tapestry Households in the geographic area. This market segment is primarily seniors at, or approaching, retirement, with below average labor force participation and above average Net Worth. Although located in predominantly metropolitan areas, they live outside central cities in small communities with lifestyles considered more 'country' than urban. <a target='_blank' href='https://links.esri.com/tapestry/segment20'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH21_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 6A: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Green Acres (6A) Tapestry Households in the geographic area. This market segment has a lifestyle that features self-reliance and enjoyment of the country. Avid do-it-yourselfers, they maintain and remodel their own homes, with all of the necessary power tools to accomplish the jobs. Gardening is a big priority to this segment. <a target='_blank' href='https://links.esri.com/tapestry/segment21'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH22_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 6B: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Salt of the Earth (6B) Tapestry Households in the geographic area. This market segment is entrenched in traditional, rural lifestyles. This population is older, many with grown children who have moved away. They cherish family time and tending to their vegetable gardens. <a target='_blank' href='https://links.esri.com/tapestry/segment22'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH23_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 6C: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of The Great Outdoors (6C) Tapestry Households in the geographic area. This market segment is found in pastoral settings throughout the United States. Consumers are educated empty nesters living an active but modest lifestyle. Their focus is land and they are more likely to invest in real estate or a vacation home. <a target='_blank' href='https://links.esri.com/tapestry/segment23'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH24_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 6D: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Prairie Living (6D) Tapestry Households in the geographic area. This market segment is the most rural of all markets, comprising about 1% of all households primarily in the Midwest, with a predominance of self-employed farmers. These agricultural communities are dominated by married-couple families that own their own property. <a target='_blank' href='https://links.esri.com/tapestry/segment24'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH25_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 6E: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Rural Resort Dwellers (6E) Tapestry Households in the geographic area. This market segment are often blue collar, older survivors of the Great Recession who went through some downsizing. Rural Resort Dweller communities are centered in resort areas, many in the Midwest. <a target='_blank' href='https://links.esri.com/tapestry/segment25'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH26_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 6F: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Heartland Communities (6F) Tapestry Households in the geographic area. This market segment is well settled and close-knit, semirural and semiretired. These older householders are primarily homeowners, and many have paid off their mortgages. Their adult children have moved away, but they have no plans to leave their homes and their hearts are with the country and a slower pace of life. <a target='_blank' href='https://links.esri.com/tapestry/segment26'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH27_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 7A: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Up and Coming Families (7A) Tapestry Households in the geographic area. This market segment is in transition: residents are younger and more mobile than the previous generation. They are ambitious, working hard to get ahead and willing to take some risks to achieve their goals. <a target='_blank' href='https://links.esri.com/tapestry/segment27'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH28_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 7B: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Urban Villages (7B) Tapestry Households in the geographic area. This market segment is multigenerational and multilingual. Trendy and fashion conscious, they are risk takers. However, these consumers also are focused on their children and maintain gardens. <a target='_blank' href='https://links.esri.com/tapestry/segment28'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH29_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 7C: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Urban Edge (7C) Tapestry Households in the geographic area. This market segment is located throughout the South and West. Most own their own homes, primarily single-family housing outside the city where housing is more affordable. Median Household Income is slightly below average. <a target='_blank' href='https://links.esri.com/tapestry/segment29'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH30_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 7D: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Forging Opportunity (7D) Tapestry Households in the geographic area. This market segment places family at the center of their ideology, bringing rich traditions to neighborhoods in the urban outskirts. Dominating this market are younger families with children or single-parent households with multiple generations living under the same roof. <a target='_blank' href='https://links.esri.com/tapestry/segment30'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH31_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 7E: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Farm to Table (7E) Tapestry Households in the geographic area. This market segment is small but distinctive, located almost entirely in the West (California and Washington). These neighborhoods are home to young families with children and, frequently, multiple generations living under the same roof. <a target='_blank' href='https://links.esri.com/tapestry/segment31'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH32_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 7F: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Southwestern Families (7F) Tapestry Households in the geographic area. This market segment is composed primarily of young families located in the Southwest. Children are the center of these married-couple or single-parent households. <a target='_blank' href='https://links.esri.com/tapestry/segment32'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH33_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 8A: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the City Lights (8A) Tapestry Households in the geographic area. This market segment is densely populated and urban. Wide-ranging demographic characteristics include a passion for social welfare and equal opportunity. <a target='_blank' href='https://links.esri.com/tapestry/segment33'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH34_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 8B: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Emerald City (8B) Tapestry Households in the geographic area. This market segment lives in lower-density neighborhoods of urban areas throughout the United States. Young and mobile, they are more likely to rent. Half have a college degree and a professional occupation with an income close to the U.S. Median Income. <a target='_blank' href='https://links.esri.com/tapestry/segment34'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH35_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 8C: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Bright Young Professionals (8C) Tapestry Households in the geographic area. This large market segment is primarily located in the urban outskirts of large, metropolitan areas. Bright Young Professionals communities are home to young, educated, working professionals, where one out of three householders is younger than age 35. <a target='_blank' href='https://links.esri.com/tapestry/segment35'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH36_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 8D: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Downtown Melting Pot (8D) Tapestry Households in the geographic area. This smaller, settled market segment is composed of much older neighborhoods located in cities in the Middle Atlantic (primarily New York state) or on the Pacific Coast. A mix of races and ethnicities with close to half of the Downtown Melting Pot segment being foreign born. <a target='_blank' href='https://links.esri.com/tapestry/segment36'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH37_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 8E: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Front Porches (8E) Tapestry Households in the geographic area. This market segment is a blend of household types, with more young families with children and more single households than average. Half of householders are renters, and many of their homes are older townhomes or duplexes. <a target='_blank' href='https://links.esri.com/tapestry/segment37'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH38_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 8F: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Old and Newcomers (8F) Tapestry Households in the geographic area. This market segment features singles' lifestyles on a budget, with emphasis more on convenience than consumerism, economy over acquisition. Old and Newcomers is composed of neighborhoods in transition, populated by renters at the start of their careers. <a target='_blank' href='https://links.esri.com/tapestry/segment38'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH39_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 8G: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Hometown Heritage (8G) Tapestry Households in the geographic area. This slightly smaller market segment features neighborhoods with older housing in urbanized areas within central cities, located primarily in the Midwest and South. This is a family market, married couples, both with and without children. <a target='_blank' href='https://links.esri.com/tapestry/segment39'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH40_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 9A: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Silver and Gold (9A) Tapestry Households in the geographic area. This is almost the oldest market segment and the most affluent senior market. Their affluence has given Silver and Gold the opportunity to retire to sunnier climates that feature exclusive retirement communities. <a target='_blank' href='https://links.esri.com/tapestry/segment40'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH41_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 9B: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Golden Years (9B) Tapestry Households in the geographic area. This market segment is independent and active seniors nearing the end of their careers or already in retirement. Golden Years are primarily single living alone or empty nesters. Those still active in the labor force are typically employed in professional occupations. <a target='_blank' href='https://links.esri.com/tapestry/segment41'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH42_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 9C: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of The Elders (9C) Tapestry Households in the geographic area. This market segment has a median age of 71.8, making it the oldest tapestry segment. The Elders favor communities designed for senior or assisted living, often as homeowners and primarily in warmer climates with seasonal populations. <a target='_blank' href='https://links.esri.com/tapestry/segment42'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH43_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 9D: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Senior Escapes (9D) Tapestry Households in the geographic area. This market segment lives in neighborhoods heavily concentrated in the warmer states of Florida, California, and Arizona. These areas are highly seasonal, but primarily Owner-Occupied. What started as seasonal getaways are now primary residences. Forty percent are mobile homes. <a target='_blank' href='https://links.esri.com/tapestry/segment43'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH44_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 9E: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Retirement Communities (9E) Tapestry Households in the geographic area. This market segment is evenly distributed across the country, combining single-family homes and independent living with apartments, assisted living, and continuous care nursing facilities. Over half of their housing units are in multi-unit structures. <a target='_blank' href='https://links.esri.com/tapestry/segment44'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH45_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 9F: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Social Security Set (9F) Tapestry Households in the geographic area. This older market segment is located in metropolitan cities across the country. Over one-third of Social Security Set householders are age 65+ and dependent on low, fixed incomes, primarily Social Security. <a target='_blank' href='https://links.esri.com/tapestry/segment45'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH46_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 10A: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Southern Satellite (10A) Tapestry Households in the geographic area. This second-largest market segment is found in rural settlements and metropolitan areas primarily in the South. Southern Satellites are typically slightly older, settled married-couple families who own their homes, almost two-thirds of which are single-family structures. <a target='_blank' href='https://links.esri.com/tapestry/segment46'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH47_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 10B: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Rooted Rural (10B) Tapestry Households in the geographic area. This market segment is heavily concentrated in the Appalachian mountain range, Texas, and Arkansas. A common occupation is Forestry, and Rooted Rurals often live in many of the heavily forested regions of the U.S. and enjoy time spent outdoors. <a target='_blank' href='https://links.esri.com/tapestry/segment47'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH48_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 10C: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Economic BedRock (10C) Tapestry Households in the geographic area. This market segment is very rural and primarily Southern. Close to one in five employed Economic Bedrocks work in mining, oil and gas extraction, or quarrying. Over half are married-couple family households, and one quarter live in mobile homes. <a target='_blank' href='https://links.esri.com/tapestry/segment48'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH49_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 10D: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Down the Road (10D) Tapestry Households in the geographic area. This market segment is young, family-oriented living in a mix of low-density, semirural neighborhoods in large metropolitan areas. Approximately half are in the South and the rest in the West and Midwestern United States. <a target='_blank' href='https://links.esri.com/tapestry/segment49'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH50_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 10E: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Rural Bypasses (10E) Tapestry Households in the geographic area. This market segment is characterized by open space, undeveloped land, and farmland. Rural Bypasses families live within small towns along country back roads in sparsely populated neighborhoods and focus on the outdoors, gardening, and hunting. <a target='_blank' href='https://links.esri.com/tapestry/segment50'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH51_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 11A: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the City Strivers (11A) Tapestry Households in the geographic area. This market segment is typically located in high-density city neighborhoods and characterized by a relatively young, foreign-born population who have embraced the American lifestyle yet retained their cultural integrity. To support their lifestyle, City Strivers typically commute long distances. <a target='_blank' href='https://links.esri.com/tapestry/segment51'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH52_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 11B: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Young and Restless (11B) Tapestry Households in the geographic area. This market segment is typically well-educated, young workers, some of whom are still completing their education, and are often employed in professional/technical occupations, as well as sales and office/administrative support roles. Young and Restless are not yet established but are striving to get ahead. <a target='_blank' href='https://links.esri.com/tapestry/segment52'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH53_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 11C: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Metro Fusion (11C) Tapestry Households in the geographic area. This market segment is young, many do not speak English fluently, and have moved into their homes recently. They are highly mobile and over three quarters of households are Renter-Occupied. Many households have young children. <a target='_blank' href='https://links.esri.com/tapestry/segment53'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH54_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 11D: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Set to Impress (11D) Tapestry Households in the geographic area. This market segment is characterized by medium-to-large, multiunit apartment buildings with lower-than-average rent, often in neighborhoods with multi-use buildings and single-family housing. Nearly one-third is age 20-34 and live in single person, nonfamily households. <a target='_blank' href='https://links.esri.com/tapestry/segment54'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH55_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 11E: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the City Commons (11E) Tapestry Households in the geographic area. This market segment is one of the youngest and largest. It is primarily comprised of single-parent and single-person households located within large metropolitan centers in the eastern half of the United States. While more than one-third have a college degree or some college, nearly one-fourth did not complete high school. <a target='_blank' href='https://links.esri.com/tapestry/segment55'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH56_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 12A: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Family Foundations (12A) Tapestry Households in the geographic area. This market segment considers family and faith to be their cornerstones. Older children, still living at home and working toward financial independence, are common. Neighborhoods are stable but little household growth has occurred over the past decade. Healthcare and public administration across all levels of government are common occupations. <a target='_blank' href='https://links.esri.com/tapestry/segment56'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH57_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 12B: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Traditional Living (12B) Tapestry Households in the geographic area. This market segment lives primarily in low-density, settled neighborhoods in the Midwest. Households are a mix of married-couple families and singles. Many families encompass two generations who have lived and worked within the same community and their children are likely to follow suit. Manufacturing, retail, and healthcare are common occupations. <a target='_blank' href='https://links.esri.com/tapestry/segment57'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH58_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 12C: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Small Town Sincerity (12C) Tapestry Households in the geographic area. This market segment includes young families and senior householders bound by community ties. Their lifestyle is down-to-earth and semirural, with television for both entertainment and information, and an emphasis on convenience. <a target='_blank' href='https://links.esri.com/tapestry/segment58'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH59_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 12D: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Modest Income Homes (12D) Tapestry Households in the geographic area. This urban market segment may be nontraditional, however, religious faith and family values guide their modest lifestyles. Many Modest Income Homes are primary caregivers for elderly family members. Jobs are often scarce and reliance on public assistance income, such as Social Security, is often necessary to support single-parent and multigenerational families. <a target='_blank' href='https://links.esri.com/tapestry/segment59'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH60_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 13A: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Diverse Convergence (13A) Tapestry Households in the geographic area. This market segment is a rich blend of cultures found in densely populated urban and suburban areas, almost entirely in the Middle Atlantic, particularly New York and New Jersey, and California. Almost 40% are foreign-born. Young families renting apartments in older buildings dominate this segment; about one-fourth have children. <a target='_blank' href='https://links.esri.com/tapestry/segment60'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH61_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 13B: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Family Extensions (13B) Tapestry Households in the geographic area. This market segment is family-oriented and distinguished by multigenerational households. Their spending reflects their children: baby food, and children's furniture and apparel; or convenience: fast food and family restaurants. <a target='_blank' href='https://links.esri.com/tapestry/segment61'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH62_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 13C: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the NeWest Residents (13C) Tapestry Households in the geographic area. This market segment is new to America and to their careers, often with new, young families. Many are also new to the English language; nearly one-third are linguistically isolated. <a target='_blank' href='https://links.esri.com/tapestry/segment62'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH63_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 13D: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Fresh Ambitions (13D) Tapestry Households in the geographic area. This market segment consists of young families, many of whom are recent immigrants, who focus their life and work around their children. Fresh Ambitions have overcome the language barrier and earned a high school diploma. They work overtime in service, skilled, and unskilled occupations, and spend what they have on their children. <a target='_blank' href='https://links.esri.com/tapestry/segment63'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH64_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 13E: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the High Rise Renters (13E) Tapestry Households in the geographic area. This market segment is located predominantly in the Northeast, particularly New York City. This segment is highest in density, diversity, presence of adult children, linguistic isolation, and foreign-born population. They often travel for employment, usually for service jobs. <a target='_blank' href='https://links.esri.com/tapestry/segment64'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH65_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 14A: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Military Proximity (14A) Tapestry Households in the geographic area. This is one of the youngest market segments, typically married-couple families just beginning parenthood, with an average household size of 3.38. The Armed Forces is the common bond for this segment, and most of the labor force in this segment are military active duty or have military-adjacent civilian jobs. <a target='_blank' href='https://links.esri.com/tapestry/segment65'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH66_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 14B: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the College Towns (14B) Tapestry Households in the geographic area. This market segment is nearly 50% college students, while the other half typically work for the college or the services that support it. Students, while busy, make time between studying and part-time employment for socializing and sports. College Towns are typically new to financial management, are very digitally engaged for all aspects of life, and seek variety and adventure. <a target='_blank' href='https://links.esri.com/tapestry/segment66'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH67_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 14C: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Dorms to Diplomas (14C) Tapestry Households in the geographic area. This market segment is often living on their own for the first time and learning about financial management and cooking. Shopping is sporadic, and preferences are just being established. <a target='_blank' href='https://links.esri.com/tapestry/segment67'>Read more.</a>"},"TAPESTRYHOUSEHOLDSNEWTHH68_P":{"type":"number","alias":"2023 HHs in Tapestry Seg 15: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Unclassified (15) Tapestry Households in the geographic area. Tapestry Unclassified neighborhoods include unpopulated areas, such as parks, golf courses, open spaces, and other types of undeveloped land. Institutional Group Quarters, such as prisons, juvenile detention homes, and mental health facilities, as well as areas with insufficient data for classification are also part of this segment. See <a target='_blank' href='https://links.esri.com/demographics/tapestry'>Tapestry Segmentation</a> for more information on Tapestry Segmentation."},"_5YEARINCREMENTSMALE0_CY_P":{"type":"number","alias":"2023 Males Age 0-4: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Male Population Age 0-4 in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"_5YEARINCREMENTSM 23","source":"Esri","definition":"Esri 2023 Estimate (#) of the number of Households with Income $200,000+ in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.WEALTHWLTHINDXCY":{"id":"WLTHINDXCY","fullName":"Wealth.WLTHINDXCY","alias":"2023 Wealth Index","fieldName":"WEALTHWLTHINDXCY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.WEALTHWLTHINDXCY","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Wealth Index summarizes the wealth of a geographic area relative to the national level. Wealth is calculated from a number of indicators of affluence that include household income and average net worth. The concept of wealth is defined by more than just above-average household income; it also includes the value and abundance of material possessions and resources. Esri captures both aspects in its identification of the wealthiest areas in the country. The national index value is set to 100: values exceeding 100 represent above-average wealth while values below 100 represent below-average wealth. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.HOUSINGUNITTOTALSHAI_CY":{"id":"HAI_CY","fullName":"housingunittotals.HAI_CY","alias":"2023 Housing Affordability Index","fieldName":"HOUSINGUNITTOTALSHAI_CY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.HOUSINGUNITTOTALSHAI_CY","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Housing Affordability Index (HAI) measures the ability of a typical resident to purchase a home in the geographic area. The HAI has a base of 100, representing where the median income is sufficient to qualify for a loan on a median-valued home and not be cost-burdened (cost-burdened=greater than 30% of income spent on housing). HAI values > 100 indicate increasing affordability; HAI values < 100 indicate areas where homes are less affordable and median income might be insufficient to purchase a median-valued home.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.KEYUSFACTSDIVINDX_CY":{"id":"DIVINDX_CY","fullName":"KeyUSFacts.DIVINDX_CY","alias":"2023 Diversity Index","fieldName":"KEYUSFACTSDIVINDX_CY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.KEYUSFACTSDIVINDX_CY","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 estimated Diversity Index in the geographic area. Esri's Diversity Index summarizes racial and ethnic diversity, indicating the likelihood that two individuals, chosen at random from the same area, belong to the same race or ethnic group. The index ranges from 0 (no diversity) to 100 (highest diversity). An area's Diversity Index increases when the population includes more race/ethnic groups. <a target='_blank' href='https://links.esri.com/diversity-index'>read more</a> See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.KEYUSFACTSMEDVAL_CY":{"id":"MEDVAL_CY","fullName":"KeyUSFacts.MEDVAL_CY","alias":"2023 Median Home Value","fieldName":"KEYUSFACTSMEDVAL_CY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.KEYUSFACTSMEDVAL_CY","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of the Median Home Value in the geographic area. Median Home Value divides home values into two equal groups; half of the homes will have a value higher than the median, and half lower. If the median is $2,000,000+, it is represented by a value of $2,000,001.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.KEYUSFACTSPOPGRWCYFY":{"id":"POPGRWCYFY","fullName":"KeyUSFacts.POPGRWCYFY","alias":"2023-2028 Growth Rate: Population","fieldName":"KEYUSFACTSPOPGRWCYFY","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.KEYUSFACTSPOPGRWCYFY","type":"esriFieldTypeDouble","vintage":"2028","source":"Esri","definition":"Esri 2028 five-year forecast for Population: Compound Annual Growth Rate (CAGR). The Population CAGR is an annualized measure that describes the direction (either positive or negative) and magnitude of change in the total Population between the years 2023 and 2028. The CAGR is sometimes referred to as growth rate, annual rate, annualized growth rate, or compound growth rate; reference the <a target='_blank' href='https://links.esri.com/esri-demographics/vocab'>CAGR variable formula</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.WEALTHVAL0_CY_P":{"id":"VAL0_CY_P","fullName":"Wealth.VAL0_CY_P","alias":"2023 Home Value <$50000: Percent","fieldName":"WEALTHVAL0_CY_P","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.WEALTHVAL0_CY_P","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of the number of homes with Home Value <$50,000 in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables." CollectionsCalculator","templateName":"dataCollectionsCalculator.KEYUSFACTSTOTPOP_FY","type":"esriFieldTypeDouble","vintage":"2028","source":"Esri","definition":"Esri 2028 five-year forecast for the Total Population in the geographic area. Total Population includes population living in households, on active duty in the Armed Forces, and living in group quarters such as correctional facilities, skilled nursing facilities, juvenile facilities, military barracks, and college dorms.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.TAPESTRYHOUSEHOLDSNEWTHH01_P":{"id":"THH01_P","fullName":"tapestryhouseholdsNEW.THH01_P","alias":"2023 HHs in Tapestry Seg 1A: Percent","fieldName":"TAPESTRYHOUSEHOLDSNEWTHH01_P","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.TAPESTRYHOUSEHOLDSNEWTHH01_P","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of the Top Tier (1A) Tapestry Households in the geographic area. This market segment earns more than three times the U.S. Household Income. They have high purchasing power, but what do they truly want? <a target='_blank' href='https://links.esri.com/tapestry/segment1'>Read more.</a>"},"dataCollectionsCalculator.TAPESTRYHOUSEHOLDSNEWTHH02_P":{"id":"THH02_P","fullName":"tapestryhouseholdsNEW.THH02_P","alias":"2023 HHs in Tapestry Seg 1B: Percent","fieldName":"TAPESTRYHOUSEHOLDSNEWTHH02_P","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.TAPESTRYHOUSEHOLDSNEWTHH02_P","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of the Professional Pride (1B) Tapestry Households in the geographic area. This market segment is well-educated, career professionals who have prospered through the Great Recession. To maintain their upscale and typically suburban lifestyles, these goal oriented couples work long hours and often have lengthy commutes. <a target='_blank' href='https://links.esri.com/tapestry/segment2'>Read more.</a>"},"dataCollectionsCalculator.TAPESTRYHOUSEHOLDSNEWTHH03_P":{"id":"THH03_P","fullName":"tapestryhouseholdsNEW.THH03_P","alias":"2023 HHs in Tapestry Seg 1C: Percent","fieldName":"TAPESTRYHOUSEHOLDSNEWTHH03_P","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.TAPESTRYHOUSEHOLDSNEWTHH03_P","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of the Boomburbs (1C) Tapestry Households in the geographic area. This market segment consists of young professionals with families that have opted to trade up to the newest housing in the suburbs. Boomburbs neighborhoods began growing in the 1990s and have continued to expand. <a target='_blank' href='https://links.esri.com/tapestry/segment3'>Read more.</a>"},"dataCollectionsCalculator.TAPESTRYHOUSEHOLDSNEWTHH04_P":{"id":"THH04_P","fullName":"tapestryhouseholdsNEW.THH04_P","alias":"2023 HHs in Tapestry Seg 1D: Percent","fieldName":"TAPESTRYHOUSEHOLDSNEWTHH04_P","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.TAPESTRYHOUSEHOLDSNEWTHH04_P","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of the Savvy Suburbanites (1D) Tapestry Households in the geographic area. This market segment is well educated, well read, and well capitalized. Families include empty nesters or soon-to-be so with adult children at home located in older neighborhoods outside the urban core. <a target='_blank' href='https://links.esri.com/tapestry/segment4'>Read more.</a>"},"dataCollectionsCalculator.TAPESTRYHOUSEHOLDSNEWTHH05_P":{"id":"THH05_P","fullName":"tapestryhouseholdsNEW.THH05_P","alias":"2023 HHs in Tapestry Seg 1E: Percent","fieldName":"TAPESTRYHOUSEHO :"TAPESTRYHOUSEHOLDSNEWTHH57_P","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.TAPESTRYHOUSEHOLDSNEWTHH57_P","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of the Traditional Living (12B) Tapestry Households in the geographic area. This market segment lives primarily in low-density, settled neighborhoods in the Midwest. Households are a mix of married-couple families and singles. Many families encompass two generations who have lived and worked within the same community and their children are likely to follow suit. Manufacturing, retail, and healthcare are common occupations. <a target='_blank' href='https://links.esri.com/tapestry/segment57'>Read more.</a>"},"dataCollectionsCalculator.TAPESTRYHOUSEHOLDSNEWTHH58_P":{"id":"THH58_P","fullName":"tapestryhouseholdsNEW.THH58_P","alias":"2023 HHs in Tapestry Seg 12C: Percent","fieldName":"TAPESTRYHOUSEHOLDSNEWTHH58_P","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.TAPESTRYHOUSEHOLDSNEWTHH58_P","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of the Small Town Sincerity (12C) Tapestry Households in the geographic area. This market segment includes young families and senior householders bound by community ties. Their lifestyle is down-to-earth and semirural, with television for both entertainment and information, and an emphasis on convenience. <a target='_blank' href='https://links.esri.com/tapestry/segment58'>Read more.</a>"},"dataCollectionsCalculator.TAPESTRYHOUSEHOLDSNEWTHH59_P":{"id":"THH59_P","fullName":"tapestryhouseholdsNEW.THH59_P","alias":"2023 HHs in Tapestry Seg 12D: Percent","fieldName":"TAPESTRYHOUSEHOLDSNEWTHH59_P","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.TAPESTRYHOUSEHOLDSNEWTHH59_P","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of the Modest Income Homes (12D) Tapestry Households in the geographic area. This urban market segment may be nontraditional, however, religious faith and family values guide their modest lifestyles. Many Modest Income Homes are primary caregivers for elderly family members. Jobs are often scarce and reliance on public assistance income, such as Social Security, is often necessary to support single-parent and multigenerational families. <a target='_blank' href='https://links.esri.com/tapestry/segment59'>Read more.</a>"},"dataCollectionsCalculator.TAPESTRYHOUSEHOLDSNEWTHH60_P":{"id":"THH60_P","fullName":"tapestryhouseholdsNEW.THH60_P","alias":"2023 HHs in Tapestry Seg 13A: Percent","fieldName":"TAPESTRYHOUSEHOLDSNEWTHH60_P","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.TAPESTRYHOUSEHOLDSNEWTHH60_P","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of the Diverse Convergence (13A) Tapestry Households in the geographic area. This market segment is a rich blend of cultures found in densely populated urban and suburban areas, almost entirely in the Middle Atlantic, particularly New York and New Jersey, and California. Almost 40% are foreign-born. Young families renting apartments in older buildings dominate this segment; about one-fourth have children. <a target='_blank' href='https://links.esri.com/tapestry/segment60'>Read more.</a>"},"dataCollectionsCalculator.TAPESTRYHOUSEHOLDSNEWTHH61_P":{"id":"THH61_P","fullName":"tapestryhouseholdsNEW.THH61_P","alias":"2023 HHs in Tapestry Seg 13B: Percent","fieldName":"TAPESTRYHOUSEHOLDSNEWTHH61_P","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.TAPESTRYHOUSEHOLDSNEWTHH61_P","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of the Family Extensions (13B) Tapestry Households in the geographic area. This market segment is family-oriented and distinguished by multigenerational households. Their spending reflects their children: baby food, and children's furniture and apparel; or convenience: fast food and family restaurants. <a target='_blank' href='https://links.esri.com/tapestry/segment61'>Read more.</a>"},"dataCollectionsCalculator.TAPESTRYHOUSEHOLDSNEWTHH62_P":{"id":"THH62_P","fullName":"tapestryhouseholdsNEW.THH62_P","alias":"2023 HHs in Tapestry Seg 13C: Percent","fieldName":"TAPESTRYHOUSEHOLDSNEWTHH62_P","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.TAPESTRYHOUSEHOLDSNEWTHH62_P","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of the NeWest Residents (13C) Tapestry Households in the geographic area. This market segment is new to America and to their careers, often with new, young families. Many are also new to the English language; nearly one-third are linguistically isolated. <a target='_blank' href='https://links.esri.com/tapestry/segment62'>Read more.</a>"},"dataCollectionsCalculator.TAPESTRYHOUSEHOLDSNEWTHH63_P":{"id":"THH63_P","fullName":"tapestryhouseholdsNEW.THH63_P","alias":"2023 HHs in Tapestry Seg 13D: Percent","fieldName":"TAPESTRYHOUSEHOLDSNEWTHH63_P","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.TAPESTRYHOUSEHOLDSNEWTHH63_P","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of the Fresh Ambitions (13D) Tapestry Households in the geographic area. This market segment consists of young families, many of whom are recent immigrants, who focus their life and work around their children. Fresh Ambitions have overcome the language barrier and earned a high school diploma. They work overtime in service, skilled, and unskilled occupations, and spend what they have on their children. <a target='_blank' href='https://links.esri.com/tapestry/segment63'>Read more.</a>"},"dataCollectionsCalculator.TAPESTRYHOUSEHOLDSNEWTHH64_P":{"id":"THH64_P","fullName":"tapestryhouseholdsNEW.THH64_P","alias":"2023 HHs in Tapestry Seg 13E: Percent","fieldName":"TAPESTRYHOUSEHOLDSNEWTHH64_P","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.TAPESTRYHOUSEHOLDSNEWTHH64_P","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of the High Rise Renters (13E) Tapestry Households in the geographic area. This market segment is located predominantly in the Northeast, particularly New York City. This segment is highest in density, diversity, presence of adult children, linguistic isolation, and foreign-born population. They often travel for employment, usually for service jobs. <a target='_blank' href='https://links.esri.com/tapestry/segment64'>Read more.</a>"},"dataCollectionsCalculator.TAPESTRYHOUSEHOLDSNEWTHH65_P":{"id":"THH65_P","fullName":"tapestryhouseholdsNEW.THH65_P","alias":"2023 HHs in Tapestry Seg 14A: Percent","fieldName":"TAPESTRYHOUSEHOLDSNEWTHH65_P","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.TAPESTRYHOUSEHOLDSNEWTHH65_P","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of the Military Proximity (14A) Tapestry Households in the geographic area. This is one of the youngest market segments, typically married-couple families just beginning parenthood, with an average household size of 3.38. The Armed Forces is the common bond for this segment, and most of the labor force in this segment are military active duty or have military-adjacent civilian jobs. <a target='_blank' href='https://links.esri.com/tapestry/segment65'>Read more.</a>"},"dataCollectionsCalculator.TAPESTRYHOUSEHOLDSNEWTHH66_P":{"id":"THH66_P","fullName":"tapestryhouseholdsNEW.THH66_P","alias":"2023 HHs in Tapestry Seg 14B: Percent","fieldName":"TAPESTRYHOUSEHOLDSNEWTHH66_P","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.TAPESTRYHOUSEHOLDSNEWTHH66_P","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of the College Towns (14B) Tapestry Households in the geographic area. This market segment is nearly 50% college students, while the other half typically work for the college or the services that support it. Students, while busy, make time between studying and part-time employment for socializing and sports. College Towns are typically new to financial management, are very digitally engaged for all aspects of life, and seek variety and adventure. <a target='_blank' href='https://links.esri.com/tapestry/segment66'>Read more.</a>"},"dataCollectionsCalculator.TAPESTRYHOUSEHOLDSNEWTHH67_P":{"id":"THH67_P","fullName":"tapestryhouseholdsNEW.THH67_P","alias":"2023 HHs in Tapestry Seg 14C: Percent","fieldName":"TAPESTRYHOUSEHOLDSNEWTHH67_P","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.TAPESTRYHOUSEHOLDSNEWTHH67_P","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of the Dorms to Diplomas (14C) Tapestry Households in the geographic area. This market segment is often living on their own for the first time and learning about financial management and cooking. Shopping is sporadic, and preferences are just being established. <a target='_blank' href='https://links.esri.com/tapestry/segment67'>Read more.</a>"},"dataCollectionsCalculator.TAPESTRYHOUSEHOLDSNEWTHH68_P":{"id":"THH68_P","fullName":"tapestryhouseholdsNEW.THH68_P","alias":"2023 HHs in Tapestry Seg 15: Percent","fieldName":"TAPESTRYHOUSEHOLDSNEWTHH68_P","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.TAPESTRYHOUSEHOLDSNEWTHH68_P","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (
